INSERT INTO `singer` VALUES ('2116', '陈奕迅', '陈奕迅（Eason Chan），1974年7月27日出生于中国香港，祖籍广东省东莞市，中国香港流行乐男歌手、演员、作曲人，毕业于英国金斯顿大学。\n1995年参加第14届新秀歌唱大赛并获得冠军，同年正式出道。1996年发行个人首张专辑《陈奕迅》。1997年主演个人首部电影《旺角大家姐》。1998年凭借歌曲《天下无双》在乐坛获得关注。2000年发行的歌曲《K歌之王》奠定其在歌坛的地位。2001年发行流行摇滚风格的专辑《反正是我》。2003年发行个人首张概念专辑《黑·白·灰》，专辑中的歌曲《十年》获得第4届音乐风云榜十大金曲奖；同年凭借专辑《Special Thanks to》获得第14届台湾金曲奖最佳国语男歌手以及最佳专辑奖。\n2005年发行粤语专辑《U87》，专辑中的歌曲《浮夸》成为其歌唱生涯的代表作品之一。2006年起连续九年获得叱咤乐坛流行榜颁奖典礼我最喜爱的男歌手奖。2007年获得十大劲歌金曲最受欢迎男歌星奖。2010年凭借剧情片《金钱帝国》获得星光大典港台年度电影男演员奖。2012年发行舞曲风格的粤语专辑《…3mm》。2015年凭借专辑《米·闪》获得第26届台湾金曲奖最佳国语男歌手奖。2016年举行“Another Eason\'s LIFE世界巡回演唱会”。2018年凭借专辑《C\'mon in~》获得第29届台湾金曲奖最佳国语男歌手奖 ；同年发行专辑《L.O.V.E.》；同年，其主演的电影《卧底巨星》上映。 2020年7月11日在香港举办《Live is so much better with Music Eason Chan Charity Concert》慈善音乐会。\n			', 'http://p1.music.126.net/w_vuv9hBWq2hlJxJcmJrjg==/109951166115915081.jpg');
INSERT INTO `singer` VALUES ('3706', '林子祥', '香港著名歌手和演员。1980年，他凭《在水中央》及《分分钟需要你》两首歌曲在第三届十大中文金曲颁奖音乐会连获两个金曲奖，成为当年的大赢家。而在1994年举行的香港电台第十七届《十大中文金曲颁奖音乐会》上，林子祥获颁“香港乐坛最高荣誉──金针奖”。2003年，林子祥获得CASH音乐成就大奖，是首位唱作人获得此殊荣。综观整个八十年代，在这十年之间，他共有23首歌曲登上香港电台中文歌曲龙虎榜冠军位置，仅次于谭咏麟的28首。他也是众多演艺界人士的偶像或最喜爱的歌手，包括徐小凤、梅艳芳、张国荣、刘德华等等。', 'http://p1.music.126.net/nWi2HOAT6-sgqPM2QR15EA==/253987186033427.jpg');
INSERT INTO `singer` VALUES ('3707', '郎朗', '郎朗，满族人。国际著名钢琴家，1982年生于辽宁沈阳。被数家美国权威媒体称作“当今这个时代最天才、最闪亮的偶像明星”，他是受聘于世界顶级的柏林爱乐乐团和美国五大交响乐团的第一位中国钢琴家。曾被《人物》杂志称为“将改变世界的20名青年”之一。', 'http://p2.music.126.net/xDwh6Q--M2CdxMshEwVIJQ==/18802748346768598.jpg');
INSERT INTO `singer` VALUES ('3762', '吕思清', '第一位夺得意大利帕格尼尼国际小提琴大赛金奖的东方人。作为中国最具影响力的杰出小提琴家，吕思清长期受邀与全球知名乐团合作巡演、参加世界各地艺术节及音乐节活动，同时带领他于2011年创办的”美杰三重奏”举行室内乐音乐会，足迹遍布世界四十多个国家和地区。近年吕思清担任国家大剧院”五月音乐节”艺术总监。吕思清曾与Philips、Marco Polo、Naxos、ABC Classics及BIS等在内的世界知名唱片公司合作出版逾20张个人专辑。', 'http://p2.music.126.net/QysH3_BfGgsYAxRmSUDs_g==/680597697619150.jpg');
INSERT INTO `singer` VALUES ('4171', '刘昊霖', '刘昊霖工作室（HL STUDIO）制作人/音乐人\n\nAdventure is out there. Go for it.', 'http://p1.music.126.net/26NXODbFDr8O57hn35aTPQ==/1393081241592696.jpg');
INSERT INTO `singer` VALUES ('4213', '梁凡', '2010年参加湖南卫视快乐男生进入全国 60强。2011年获得省音协举办的陕西省声乐奖冠军。\n2012年参加东方卫视声动亚洲，现场与乐队配合即兴创作演唱博得众赞。2015年转型唱作人参加第二季《中国好歌曲》                  以一首抒情温婉的《阿楚姑娘》赢得了周华健、蔡健雅、刘欢等三位导师的推杆，最终在力邀下加入了刘欢老师的队伍，代表作《阿楚姑娘》也成了大众翻唱的热门歌曲。\n 2015年中旬，在结束中国好歌曲比赛后，以歌手，作曲，编曲，制作人的身份，与广州半音文化发展有限公司合作发行首张个人专辑《倒车Remind Me》。整张专辑七首歌曲风格无一相同，专辑幕后团队汇集祖国南北地域优秀音乐人，还有国外乐手的鼎力支持。\n2015年西安音乐广播FM931 20周年新台歌，担任制作人，作曲，编曲及演唱\n为内地电视剧《美梦成真》演唱主题曲《美梦多重要》\n为著名歌手满文军创作单曲《双城印象》\n 为中国好声音曹寅创作单曲《忽而今夏》\n为中国好声音成彧创作单曲《旁观者》\n为著名歌手孙露创作单曲《听回忆说》\n为中国好歌曲方毅担任作品《模样》《三十》制作人及编曲\n为中国好声音田丹新专辑创作《旧照片》并担任制作人及编曲\n2012年至2014年 西安天声我才K歌争霸赛担任评委与明星导师\n2013年百事最强音校园歌手大赛担任嘉宾评委\n2013年东方卫视中国达人秀西安地面选拔赛评委\n2015年雪碧音碰音西安唱区评委\n2015年星秀娱乐Top Star顶级明星选拔赛担任评委与明星导师\n2015年梦声音青少年公益歌唱比赛担任梦想导师', 'http://p2.music.126.net/LLtGJZEHe1fCUNSHfvBVwA==/18702692789117314.jpg');
INSERT INTO `singer` VALUES ('4556', '麻园诗人', '麻园诗人乐队于2008年初建立，是中国第一支将grunge与trip-hop、dancerock融合的年轻乐队，麻园诗人自始在属于他们的美学世界里冲撞，从最具画面感、情绪化的唱作到时尚煽情的舞台魅力，形成麻园诗人独具体系的音乐王国；', 'http://p1.music.126.net/XL2IWAsvBzN1lic_GrzRHQ==/109951163261529408.jpg');
INSERT INTO `singer` VALUES ('4721', '朴树', '中国大陆歌手，音乐人。1996年10月正式成为“麦田音乐”签约歌手，为简略笔划而定艺名朴树。首支单曲《火车开往冬天》，96年底推出后成绩斐然。99年1月，推出首张个人专辑《我去两千年》。99年12月与华纳唱片正式签订唱片合约，成为其亚太区旗下的第一位内地歌手，其首张专辑《我去两千年》将由华纳重新混录和拍摄最新单曲录影带后，于2000年上半年在海外隆重上市。代表作品：《那些花儿》，《白桦林》，《生如夏花》。主要成就：中歌榜最佳新人奖，最受欢迎男歌手，年度最佳制作人奖。　', 'http://p2.music.126.net/YDKUscOIKTm7Ko7KyKWggw==/3346913395417148.jpg');
INSERT INTO `singer` VALUES ('4873', '奇然', '奇然，中国古风歌手，国风音乐人，平行世界工作室室长。代表作《琵琶行》、《离骚》《燃犀照夜》、《雨过昔年》。毕业于上海戏剧学院，建立平行世界工作室，专注国风音乐创作十余年。17年创作“高考背书系列歌曲”：《琵琶行》、《离骚》等歌曲被数千家官方媒体、新闻报道，为年轻人了解古文和国风文化起到建设性作用。', 'http://p2.music.126.net/LnLSDqRXqBB5vXdG77rozw==/109951163647956392.jpg');
INSERT INTO `singer` VALUES ('5568', 'Winky诗', '歌手、词曲作者、制作人。没啥代表作。或者每首都算代表作。', 'http://p1.music.126.net/j8IConD2leR_O5msR9V4UA==/109951163783841048.jpg');
INSERT INTO `singer` VALUES ('5768', '萧敬腾', '从选秀节目出道成为华语音乐市场巨星，喜欢尝试音乐发展的各种可能性，从歌手、演员、主持人到作家，他勇敢挑战自我，他是从不害怕跟别人不一样的老萧。\n 出生于台湾花莲县丰滨乡，在台北市万华区成长。歌声浑厚高亢，唱腔丰富且有爆发力。他原本在餐厅驻唱，2007年因为参加台湾电视歌唱选秀节目第一届《超级星光大道》的踢馆单元而一举成名。2008年3月，华纳唱片公司宣布与萧敬腾签约，同年推出个人首张专辑《萧敬腾同名专辑》正式发行。\n\n2020年底，萧敬腾推出全新单曲〈萨哈星球〉，上线不到一周，成绩即疯狂登上各大数字音乐榜冠军宝座 。继〈萨哈星球〉后，萧敬腾又推出了酝酿近一年的「神秘计划」－与「知名YouTuber」老高所推出的全新单曲〈星期三〉。\n\n萧敬腾个人的YOUTUBE频道《萧房车》 更受到了大家的喜爱，短时间内创下了破百万高点击率。', 'http://p2.music.126.net/Ps0mwB_ncAfOlbyEb6tWEQ==/109951166530814275.jpg');
INSERT INTO `singer` VALUES ('5770', '许巍', '内地摇滚音乐界的重要人物。1995年，许巍作词作曲的《执着》被歌手田震唱红大江南北，并有机会签约红星生产社出版了首张专辑《在别处》，立刻引起了轰动，专辑在无任何的宣传情况下，销售量达50万张。近年，许巍一直活跃在歌坛，不仅不断发行自己的音乐作品，还不忘向歌坛输送好歌好曲。1998年更作为流行乐界仅有的二位作者，其作品和崔健一起被选入中国当代诗歌文选。			\n			', 'http://p1.music.126.net/Ga4N1OpNuRDwy0g4ByxTVw==/109951163498751996.jpg');
INSERT INTO `singer` VALUES ('5781', '薛之谦', '薛之谦（Joker Xue），1983年7月17日出生于上海，中国内地流行乐男歌手、影视演员、音乐制作人，毕业于格里昂酒店管理学院。\n2005年，因参加选秀节目《我型我秀》而正式出道。2006年，发行首张同名专辑《薛之谦》，随后凭借歌曲《认真的雪》获得广泛关注。2007年，凭借专辑《你过得好吗》获得MusicRadio中国TOP排行榜内地年度最受欢迎男歌手奖。2008年，发行专辑《深深爱过你》，同年在上海举行个人首场演唱会“谦年传说”。2013年，专辑《几个薛之谦》获得MusicRadio中国TOP排行榜内地推荐唱片。2014年，凭借专辑《意外》获得第21届东方风云榜颁奖最佳唱作人；同年他还获得音悦V榜年度盛典年度创作歌手奖。\n2015年6月，薛之谦首度担当制作人并发行原创EP《绅士》；同年，他还主演都市励志剧《妈妈像花儿一样》。2016年，凭借EP《绅士》、《一半》获得第16届全球华语歌曲排行榜最受欢迎男歌手、五大最受欢迎男歌手奖、上海地区杰出歌手奖及最受欢迎创作歌手奖，而歌曲《初学者》则获得年度二十大金曲奖。2017年4月，开启“我好像在哪见过你”全国巡回演唱会；同年，薛之谦获得第7届全球流行音乐年度盛典年度最佳男歌手及MusicRadio榜中国TOP排行榜内地最佳男歌手。\n2018年7月，薛之谦“摩天大楼”世界巡回演唱会于北京站启程，整个巡演横跨4大洲，8个国家，21个城市，累计上演场次23场。2020年12月31日，发行第11张个人专辑《天外来物》。', 'http://p2.music.126.net/LCWqYYKoCEZKuAC3S3lIeg==/109951165034938865.jpg');
INSERT INTO `singer` VALUES ('5997', '小曲儿', '小曲儿，知名古风音乐唱作人。2012年发行的个人首张原创古风专辑《曲倾天下》倍受好评。2014年发行的个人第二张原创古风专辑《曲终人未散》更赢得了广大粉丝的追捧。其中《上邪》、《忘川》等歌曲，深受听众喜爱。2017年个人第三张音乐专辑《十念》已发行。', 'http://p2.music.126.net/ahFZYenRB8roG1q0G2LeuA==/109951162895990149.jpg');
INSERT INTO `singer` VALUES ('6309', 'Mai', 'Mai 自2007年活跃于中国Hip-Hop舞台，曾创立西安知名团体X.A.E.R及xXx。\n录音、混音、编曲、词曲、演唱合为一体的Mai现以制作人身份依然保持每年300＋首单曲制作高质产出的恐怖速度。\n融合多变的风格、亚洲与欧美的混合理念是Mai的制作理念，除作为红花会的团体制作人外，也曾为爱奇艺、网易云音乐、腾讯等平台担当Hip-Hop制作人，与满舒克、T T、海尔兄弟、Jony J、陈奂仁 等等国内一线艺术家保持长期合作。', 'http://p1.music.126.net/U1S-m3mpjQl4SBzZWmwnOQ==/109951165823289965.jpg');
INSERT INTO `singer` VALUES ('6472', '张杰', '张杰，华语LIVE王。\n出道16年来，发行了14张专辑，200多首高品质音乐作品，40多首OST金曲，拥有众多被广为传唱的歌曲。近年来，他创新运用MIX-POP曲风，开辟音乐发展新征程。\n170多个音乐奖项，让他实现内地音乐奖项大满贯。2010年，获得韩国Mnet亚洲音乐盛典“亚洲之星”大奖；2014年，获得第42届全美音乐奖“年度国际艺人大奖”，成为内地首位获得该奖项的歌手。\n至今为止，举办了 61场大型演唱会，巡演足迹踏过海内外30余座城市，累计130万人观看。2018、2019连续两年打破鸟巢单场演唱会票房纪录。', 'http://p2.music.126.net/nYcbvtFppDltDtt3XhQZDg==/109951166308996364.jpg');
INSERT INTO `singer` VALUES ('6731', '赵雷', '民谣音乐人赵雷，中国内地新生代民谣歌手。1986年7月20日生于北京，高中时间接触音乐，开始学习吉他。年纪轻轻便踏遍祖国的大江南北，山河东西，足迹遍布陕甘、云藏，为自己的音乐之路，积累了大量时代底蕴与人文滋养。赵雷的音乐，虽然没有诗句般的柔情感动，但痞子气的调侃，单纯率直直达你的内心。词作、编曲朴实坦诚以描写生活中细微见长，每一首歌都像一部短剧，折射出他自己的生活、他眼中社会、甚至他心底的梦想，画面感极强。是最具传统北京胡同文化气质的新生代音乐人之一。', 'http://p1.music.126.net/j6KWzSdlRKzZUwJnQx3vBA==/3300733912483912.jpg');
INSERT INTO `singer` VALUES ('7570', '邓丽君', '邓丽君（1953年1月29日-1995年5月8日），出生于中国台湾省云林县褒忠乡田洋村，祖籍河北省大名县，中国台湾女歌手，日本昭和时代具有代表性的日语女歌手之一。\n1967年，推出首张个人专辑，从而开始其歌唱生涯。1969年，因演唱台湾首部连续剧《晶晶》的同名主题曲而在台湾成名。20世纪70年代初期，以《千言万语》、《海韵》等作品打开香港及东南亚唱片市场。1974年，凭借日文歌曲《空港》获得日本唱片大赏“新人赏”，并由此奠定其在日本的演艺事业基础。1976年，于香港利舞台举行首次个人演唱会。1980年，当选台湾金钟奖首位最佳女歌星。80年代初期，先后受邀于林肯中心、洛杉矶音乐中心、拉斯维加斯凯撒皇宫等地举行演唱会。1983年，举行华人歌手首次巡回演唱会，此后终止商业演出活动。1984至1986年间，先后以《つぐない》、《爱人》、《时の流れに身をまかせ》三曲三次获得日本有线大赏和全日本有线放送大赏两项日本音乐颁奖礼大奖的最高奖项。1987年起，呈半隐居状态并淡出乐坛。\n1995年5月8日，邓丽君因支气管哮喘发作于泰国清迈逝世；同年香港十大中文金曲颁奖礼追认授予邓丽君“金针奖”；全日本有线放送大赏、日本有线大赏、日本唱片大赏分别追认授予邓丽君“特别功劳赏”。1996年，台湾金曲奖追认授予邓丽君“特别贡献奖”。2007年，邓丽君成为日本古贺政男音乐博物馆“大众音乐殿堂”表彰者。', 'http://p2.music.126.net/P3kTsKOpXLSAh4Cw41eF0Q==/109951165621465376.jpg');
INSERT INTO `singer` VALUES ('7763', 'G.E.M.邓紫棋', '邓紫棋（G.E.M.），本名邓诗颖，1991年8月16日出生于上海市，中国香港流行乐女歌手、词曲作者、音乐制作人。\n2008年，发行个人首张音乐EP《G.E.M.》，凭该EP获得香港叱咤乐坛流行榜“叱咤乐坛生力军女歌手（金奖）”。2009年，发行个人首张音乐专辑《18...》。2011年，成为首位登上香港体育馆开唱的90后华语女歌手。2012年，凭借音乐专辑《Xposed》入围第24届台湾金曲奖“最佳国语女歌手奖”，并获得IFPI香港唱片销量大奖“全年最高销量女歌手奖”和“最高销量国语唱片奖”。2013年，举行邓紫棋“X.X.X.”世界巡回演唱会。2014年，获得湖南卫视歌唱真人秀节目《我是歌手第二季》总决赛亚军；同年，获得第27届美国儿童选择奖“最受欢迎亚洲艺人奖”。\n2015年，登上2015年中央电视台春节联欢晚会，弹唱歌曲《多远都要在一起》；同年，位列《2015年福布斯中国名人榜》第11名。2016年，入选福布斯《全球30岁以下最具潜力音乐人榜单》；同年，获得MTV欧洲音乐奖“中国内地及香港地区最佳艺人奖”。2018年，成为美国国家航空航天局“科学突破奖”首位亚洲颁奖女艺人；同年，入选英国广播公司BBC发布的《全球最具影响力百大女性榜单》。2019年，《光年之外》MV在视频平台YouTube突破2亿次点击量。2020年，凭借音乐专辑《摩天动物园》获得第31届台湾金曲奖“评审团奖”；同年，获得Mnet亚洲音乐大奖“最佳亚洲艺人奖”。', 'http://p2.music.126.net/W42LIbHIkxcccJfQYWzSIA==/109951164561122718.jpg');
INSERT INTO `singer` VALUES ('7898', 'HITA', '国风音乐人HITA，代表作《赤伶》《礼仪之邦》《水龙吟》《昔言》等，被誉为“古风御姐”，曲风百变，温柔婉转与大气深情均能驾驭。', 'http://p1.music.126.net/tiNeb_xwg-mlY8NGLiVEFg==/109951164880172434.jpg');
INSERT INTO `singer` VALUES ('8103', '花粥', '音乐工作者', 'http://p2.music.126.net/KLsHaBhm7QSejQa8JB9ZtA==/109951162845812387.jpg');
INSERT INTO `singer` VALUES ('10142', '玄觞', '玄觞，歌手，代表作《妻书》个人专辑《心·弦》', 'http://p1.music.126.net/GnobBzNJ6lpaP4OgOPx5AA==/18722483999235305.jpg');
INSERT INTO `singer` VALUES ('10880', '朱晓玫', '朱晓玫（1949年－），法国华裔钢琴家，钢琴教授。目前居住在法国巴黎塞纳河畔，任教于巴黎音乐学院。', 'http://p1.music.126.net/5bewjSHLyu0fsDFwAdGq9Q==/109951165964956481.jpg');
INSERT INTO `singer` VALUES ('11127', 'Beyond', 'Beyond，中国香港摇滚乐队，成立于1983年，由黄家驹、黄贯中、黄家强、叶世荣组成。\n1983年参加“山叶吉他比赛”获得冠军并正式出道。1986年自资发行乐队首张专辑《再见理想》。1988年凭借粤语专辑《秘密警察》在香港乐坛获得关注；同年凭借歌曲《大地》获得十大劲歌金曲奖。1989年凭借歌曲《真的爱你》获得十大中文金曲奖、十大劲歌金曲奖。1990年凭借歌曲《光辉岁月》获得十大劲歌金曲奖。1991年主演电影《Beyond日记之莫欺少年穷》；同年9月在香港红磡体育馆举办“Beyond Live 1991 生命接触演唱会”。1992年赴日本发展演艺事业。1993年凭借粤语专辑《乐与怒》中的歌曲《海阔天空》获得十大中文金曲奖；6月30日，黄家驹去世，乐队以三名成员的组成形式继续发展。\n1994年发行专辑《二楼后座》。1995年至1999年发行的《Sound》《请将手放开》《不见不散》等五张专辑标志着乐队音乐风格的转变。1996年起连续四年获得叱咤乐坛流行榜叱咤乐坛组合金奖。1999年乐队宣布暂时解散。2002年获得第25届十大中文金曲金曲银禧荣誉大奖。2003年正式复出乐坛，并举办“Beyond超越Beyond”世界巡回演唱会。2004年凭借歌曲《长空》获得香港电影金像奖最佳原创电影歌曲奖。2005年举行“Beyond The Story Live 2005”世界巡回告别演唱会；同年乐队正式解散。2010年获得华语金曲奖“30年经典评选”的全部奖项 。\n演艺事业外，Beyond热心公益慈善。1991年前往非洲探访第三世界的穷困人民，并成立第三世界基金。', 'http://p1.music.126.net/EawqbkXCxGmxZ6nnqTKxKw==/109951165566992331.jpg');
INSERT INTO `singer` VALUES ('12111', '旅行团', '旅行团乐队，中国内地组合，由主唱孔一蝉（原名孔阳）、吉他手黄子君、键盘手韦伟、鼓手徐彪组成。2005年3月，发布乐队首支歌曲《The Story of Sun and I》并正式出道。2008年，发行乐队首张专辑《来福胶泥》。2009年， 发行EP专辑《等你吃饭》。2010年，发行两支单曲《小南》与《Marry》。2011年，发行音乐专辑《Wonderful Day》。2012年，发行单曲《北京夏夜》 。2013年4月，凭借歌曲《北京夏夜》在第13届音乐风云榜中获得最佳摇滚乐队和最佳摇滚歌曲；12月，发布音乐专辑《于是我不再唱歌》，专辑同名单曲《于是我不再唱歌》荣获第四届“阿比鹿音乐奖“最受欢迎摇滚单曲。2015年5月，发行音乐专辑《B-SIDE》；12月，发表专辑《10 Day\'s》。2016年2017年，发行音乐专辑《永远都会在》 。2018年6月21日，发表专辑《感+》。\n他们把生活当成一场旅行，又把旅行谱成诗。\n\n收录在05年摩登天空合辑中的一首“The Story of Sun and I”令歌迷们认识了旅行团。时至08年乐队推出三年磨一剑的首张专辑《来福胶泥》。轻柔的曲⻛和多重元素的巧妙混搭，不仅令这张专辑成为了当年各媒体眼中的TOP10，而乐队也因此在当时那个⻋库摇滚倍出的 时期显得独特且自然。09年乐队推出名为《等你吃饭》的全新EP，Urban-Folk打底，对日常生活的关注和体味作为笔触，颇具感染力。 时隔两年，旅行团推出了令歌迷们期待已久的全新专辑《Wonderful Day》，独立音乐元素比重的增加也让他们离之前树立的小清新形 象越来越远。2012年一直奔走在路上的旅行团乐队将创作的灵感放回了他们生活的北京。暑末推出单曲《北京夏夜》，悠扬的手⻛琴简 单的木吉他，唯美的MV，让这首单曲一经推出，便迅速获得极大反响与好评。2013年底全新EP《于是我不再唱歌》正式发行。2014年旅行团全面独立发展，成立来福胶泥工作室。2015年正值乐队发展十周年之际，5月发行全新概念专辑《B-SIDE》，《10 Days》，以及海外发行专辑《Hello》。随即开启十城巡演，与更多人分享关于音乐和时间的旅行。12月正式启动【来福胶泥电台】，与大家分享“来 自世界不同的声音”。2016年1月1日，旅行团用一场 被外界评为“站在云端、绚烂到极致”的【新开世界】专场演唱会纪念了自己十年如 梦般旅程。随即5月启动全国【新开世界】剧场巡回演唱会。\n\n2017年旅行团⻢不停蹄以迅猛之势开启新唱片《永远都会在》制作发行及 全国巡演。2018 年6月推出全新唱片《感+》，把生活中不同的感触转变成相同的感动，换化成音符去表达生活的美好。6月开启“夏之恋”全国巡演，恰逢盛夏走过全国8座城市，被广大粉丝称为“最有夏日气息的乐队”。2019年参加《乐队的夏天》，2020年参加《歌手当打之年》。2020年发行双专辑《似近似远》《似你似我》，2021举办升级版双专场全国巡演，与每一位听众共鸣的作品，在现场进化为层次丰富的Live体验，拓展现场演出的边界，是旅行团乐队不停歇的旅行。', 'http://p1.music.126.net/8QL6IejdDDTy9-sQM7EUjA==/109951165293202559.jpg');
INSERT INTO `singer` VALUES ('12977', '逃跑计划', '逃跑计划，乐队的前身是孔雀乐队，成立于2004年底，直到2007年夏天贝司手小刚的加入，乐队得以正式确立，并且乐队的音乐风格较之前也有所改变，以Indie pop(独立流行)为主，其间也融入了New wave(新浪潮)；Post punk(后朋) 等新音乐形式的元素，使得乐队的音乐在保留了原来唯美旋律的同时更加新鲜，时尚，更有活力。成员：吉他：马晓东 鼓手：李洪涛 贝斯：刚昂 键盘：菲璐 主唱：毛川', 'http://p2.music.126.net/kk_0Iy-QxjKt3Ca_pryJGA==/109951165752930430.jpg');
INSERT INTO `singer` VALUES ('13363', '小舟与旅行者', '小舟 原名 陈衍舟\n2006年签约鸟人唱片\n2007年于鸟人唱片发行专辑《老炮情歌》 同年参加《迷笛音乐节》\n2008年制作发行《三个哈密人》\n2009年邀吴俊德制作民谣专辑小舟与旅行者——《在远方》，\n2010年签约大藏唱片合作发行\n2012年与旅行者乐团在丽江合作录制《罗布泊》小舟与旅行者，并与2013年2月全国发行\n2013年6月签约中国移动咪咕音乐原创音乐人\n2013年10月参加央视9套拍摄纪录片《公路音乐之旅》\n2014年10月参加敦煌《大漠音乐节》12月《丝路庭州音乐节》\n现乐队成员：\n林杰 弹拨乐\n郝卫东 打击乐\n阿迪力 民族弦乐\n阿力 大浦\n周胜军 弹拨乐 管乐\n乐队风格：\n世界民谣（以各民族的传统乐器来演绎小舟的原创音乐）', 'http://p2.music.126.net/PKEdhGzF_1S-oHBVxBhWHA==/7907687627521643.jpg');
INSERT INTO `singer` VALUES ('13595', '中国娃娃', '中国娃娃（泰语：ไชน่า ดอลส์，英语：China Dolls）是一组流行音乐女子二人组合。\n最初由陈冠桦（娃娃）和李晓燕（贝儿）于1999年在泰国组成，签约于泰国Exact GMM，凭借首张泰语专辑《Muay Nee Kah》同名主打歌在泰国一曲成名，重新填词之后在台湾及中国大陆、新加坡、马来西亚等地发行的国语专辑《单眼皮女生》及同名主打歌红遍整个华语歌坛。\n2010年由陈冠桦（娃娃）和新成员刘佩君（丹淳）组成第二代，并发行全新国语专辑《亮晶晶》。\n2013年6月21日，娃娃和贝儿宣告重组，并参加由GMM Grammy主办的三十周年庆祝演唱会[2]，现于泰国发展演艺事业。\n2021年全面回归，举办线上见面会《Nihao Nihao China Dolls X 20th Anniversary》和发行新单曲！', 'http://p2.music.126.net/jADAKAAJ-rUHLMC5Wyfdvg==/109951166347515030.jpg');
INSERT INTO `singer` VALUES ('14001', 'DECO*27', 'DECO*27（日语：デコ・ニーナ，1986年12月16日－）为日本的男性音乐创作家。福冈县人。所属事务所为P._nc（ピンク），唱片公司为U/M/A/A（ユーマ）。', 'http://p2.music.126.net/bB4catA-Uj313g2bLZKwzQ==/109951166253665100.jpg');
INSERT INTO `singer` VALUES ('14610', '黒うさP', '黒うさP（くろうさピー），使用VOCALOID『初音ミク』『鏡音リン・レン』『KAITO』『MEIKO』 『巡音ルカ』制作翻唱和原创乐曲的音乐制作人。此外，他还作为同人作家White Flame进行作词作曲和编曲。作品中名曲众多，PV也都制作的相当华丽；特别是『千本樱』 一曲几乎家喻户晓。', 'http://p1.music.126.net/L12yd0wCfgphTS0DZ8Llpw==/109951165547308196.jpg');
INSERT INTO `singer` VALUES ('14670', 'かいりきベア', '', 'http://p1.music.126.net/aIrUdjQB57pIJ7EWzu56Fw==/109951164625233891.jpg');
INSERT INTO `singer` VALUES ('15229', 'ピノキオピー', '匹诺曹P（日语：ピノキオピー）是日本的作曲家、插画家、人物设计师。经纪公司是P._nc、所属唱片公司是U/M/A/A。从2009年开始，在视频分享网站上发表使用使用VOCALOID制作的乐曲，以ピノキオピー的身份开始活动。在2012年正式发布专辑《Obscure Questions》。名字源于首次投稿作品《ハナウタ》长鼻子的初音未来插图。', 'http://p1.music.126.net/VY6H5YCq3Zw5TC32SxQGpQ==/109951163880022721.jpg');
INSERT INTO `singer` VALUES ('15290', '澤野弘之', '澤野 弘之（さわの ひろゆき、1980年9月12日 - ）日本作曲家、編曲家、作詞家。出生于东京都。以电视剧、动画、电影、电影音乐为中心进行作曲和编曲工作，同时也为许多艺人写作曲子。所属事务所为Legendoor。代表作包括电视剧《医龙-Team Medical Dragon-》系列配乐、动画《机动战士高达 UC》、《罪恶王冠》、《进击的巨人》、《KILL la KILL》、《ALDNOAH.ZERO》、《青之驱魔师》、《终结的炽天使》、《甲铁城的卡巴内瑞》系列配乐等。', 'http://p1.music.126.net/0mt7-G73wWrvIlVoUpHR9g==/109951165609483832.jpg');
INSERT INTO `singer` VALUES ('15396', 'sasakure.UK', '', 'http://p1.music.126.net/SfxN0uK4A8awPAGRNe2mNg==/109951165066967203.jpg');
INSERT INTO `singer` VALUES ('15690', 'れるりり', '『れるりり(当社比P)』とは、VOCALOIDを使用してオリジナルの楽曲を発表しているP（プロデューサー）の一人である。', 'http://p2.music.126.net/FVWR5v84nHvfPqk2Cx6thg==/1384285151746435.jpg');
INSERT INTO `singer` VALUES ('15990', '絢香', '绚香（あやか），出生于1987年12月18日，是一名日本流行音乐女歌手，出生于大阪府守口市。前唱片公司公司为日本华纳音乐 (Warner Music (Japan) Inc.)，前经纪公司为研音，现在是个人事务所A station。出道单曲“I believe”在日本ORICON单曲榜最高排第三位，而此曲的手机铃声下载次数在42日内突破100万次，是日本女歌手史上最快纪录。', 'http://p2.music.126.net/rms4XHIYZnlB1SdidwzbNw==/109951163661804204.jpg');
INSERT INTO `singer` VALUES ('16001', 'AI', '               植村爱：AI的原名，本身有意大利的血统。1981年11月2日在美国出身鹿児岛市长大，她是Def Jam在日本签下的第一个日本歌手。1996年进入Performing Art School进修（艾莉西亚凯斯也出自该校），专攻舞蹈。最后她到L.A.深受黑人音乐的洗礼而决定往HIP HOP乐发展。', 'http://p1.music.126.net/-PhTWa0VVUH3aK3hDsRd8A==/109951166336432260.jpg');
INSERT INTO `singer` VALUES ('16664', 'JUJU', '			JUJU从12岁开始便希望可以成为一个爵士乐歌手。当在京都定居的时候，她曾经参与过不同的音乐活动，而在18岁的时候她独自到纽约定居。在纽约定居期间，她接触了爵士乐，R&B，Hip-hop，灵魂音乐，拉丁音乐和浩室音乐等多种不同的音乐风格，拓展了她的音乐知识。2001年，JUJU开始为一些其他歌手的作品作featuring演出。2002年，她为电影《凶気の桜》创作了主题曲。2004年以单曲“光の中へ”出道，同时也回到日本开始作现场演出。第三张单曲“奇迹を望むなら...”曾于USEN榜登上第一名并停留了22周。2009年4月29日，JUJU发行了第十张单曲“明日がくるなら”，作为电影“生命最后一个月的花嫁”的主题曲，也采用了与R&B男歌手JAY\'ED合作的featuring形式，成为2009年日本其中一首最受欢迎的情歌。次年2月，JUJU更是以单曲“明日がくるなら”，获得日本唱片业协会主办的“第24回日本金唱片大赏”5首年度最佳歌曲的奖项。', 'http://p2.music.126.net/2lMM0PF8E_-4KEdfKfOM_w==/109951166361922439.jpg');
INSERT INTO `singer` VALUES ('16995', 'LiSA', 'LiSA（日语：リサ，1987年6月24日－）是日本女歌手，本名織部里沙（おりべ りさ），岐阜县出身，血型为B型，曾为摇滚乐团“Love is Same All”的主唱，现所属唱片公司为日本索尼音乐娱乐旗下的SACRA MUSIC。\n演唱歌曲也被用作许多知名TV动画的片头曲和片尾曲，如《刀剑神域》、《Fate/Zero》、《鬼灭之刃》系列、《Angel Beats》、《伪恋》、《魔法科高中的劣等生》、《穿透幻影的太阳》等。\n2017年10月配信下载突破170万。被称为“摇滚精灵”、“幽浮社御用歌姬”、“摇滚女神”等。\n座右铭：今日もいい日だっ。', 'http://p1.music.126.net/s30j34kiVYmlmZS7dJYUCQ==/109951166541142271.jpg');
INSERT INTO `singer` VALUES ('18131', '内田光子', '内田光子（日语：內田光子，英语：Dame Mitsuko Uchida，1948年12月20日 - ），英国日本裔古典钢琴家、指挥家。生于日本静冈县热海市，现定居伦敦。她以对莫扎特和舒伯特的诠释而闻名，是公认的“莫扎特专家”。', 'http://p2.music.126.net/it8WWkUDTGCBUU3BCH9GbA==/903798558081494.jpg');
INSERT INTO `singer` VALUES ('18771', 'back number', 'back number是日本的三人摇滚乐队。通称：「バクナン」、「bn」。2004年结成。所属演艺事务所是 id ENTERTAINMENT。所属唱片公司是环球音乐，厂牌是UNIVERSAL SIGMA。官方粉丝俱乐部是“one room”。', 'http://p2.music.126.net/40rRyoi5IfniRfPueYRgag==/109951166501656671.jpg');
INSERT INTO `singer` VALUES ('18965', 'cosMo@暴走P', 'cosMo（暴走P）とは、VOCALOIDP（プロデューサー）、および歌い手のひとりである。 通称「こすもたん」 「こすもん」。　誕生日は4月6日。\n最近ごりらということが判明した。\n「∞-InfinitY-シリーズ」を主とするBPM200を超える超ハイテンポ曲や、「暴走シリーズ」などの高速電波曲に定評がある。\n 代表作に『初音ミクの消失 -DEAD END-』『初音ミクの暴走』『鏡音レンの暴走』など。30作品以上の殿堂入り曲を有し、抜群の実力と人気を誇る。', 'http://p1.music.126.net/sVeRS3m2074KB7LvjBw0Fw==/109951163508688902.jpg');
INSERT INTO `singer` VALUES ('19353', 'EGOIST', '	EGOIST是在2011年10月TV动画《罪恶王冠》中设定的拥有超高人气及超大影响力的的网络歌手，在剧中演唱OP/ED以及插曲。而实际上这位歌手则是由supercell的ryo担任制作、并由ryo选出的chelly担任演唱的角色。在该动画结束后仍继续以团体名称活跃，所属唱片公司为SACRA MUSIC。', 'http://p1.music.126.net/aQDNTJbTXFyk6MG3Ky9HaA==/109951166630376176.jpg');
INSERT INTO `singer` VALUES ('22300', 'UVERworld', '2005年夏出道的新时代日本mixture,pop,rock乐队。UVER=OVER（德语），UVERworld=OVER THE WORLD。“成为超越世界的乐队”，他们怀着这一信念，乐队名也由此而来。乐队作品在富有透明感的旋律里，夹杂着酷酷的rap，刮碟，human beat box，还有重重的吉他重奏，创作出“日本摇滚流行混合体”全新的音乐风格的5人乐队。', 'http://p2.music.126.net/SW7KCI-uRhGVgs9I67349A==/109951166627354511.jpg');
INSERT INTO `singer` VALUES ('28585', 'Alexei Lubimov', '阿列克谢·波里索维奇·鲁比莫夫（俄语：Алексе́й Бори́сович Люби́мов，罗马化：Alexey Borisovich Lyubimov，1944年－），俄罗斯钢琴家。', 'http://p2.music.126.net/qaRA77HgCRi6_pz1rzifDQ==/109951163448329767.jpg');
INSERT INTO `singer` VALUES ('28702', 'Arthur Grumiaux', '亚瑟·格鲁米欧（Arthur Grumiaux，1921年3月21日 - 1986年10月16日），比利时小提琴家。\n\n格鲁米欧的演奏，音色纯净、典雅，经常是一种柔美中的静谧，有一种清香高洁之美。格吕米奥留下的大量录音中，第一位的是对莫扎特与舒伯特的演绎，第二位是对巴赫的演绎，然后才是贝多芬、勃拉姆斯与其他作曲家。他有一把名为“泰坦”的斯特拉迪瓦里琴，但在音乐会上通常使用一把1744年制造的“瓜纳里”琴。', 'http://p1.music.126.net/pftO8EOqd6PBeN6FFLegNQ==/109951165921247562.jpg');
INSERT INTO `singer` VALUES ('28998', 'Aldo Ciccolini', '阿尔多·齐科里尼（Aldo Ciccolini，1925年8月15日－2015年2月1日），意大利钢琴家。就学于那不勒斯音乐学院，1942年在那不勒斯演奏肖邦的第二协奏曲而崭露头角，1949年获玛格丽特·隆国际比赛一等奖。奇科利尼擅长演奏弗雷、圣桑、萨蒂等法国作曲家的作品，其录制的萨蒂钢琴作品全集，获得极高的赞誉。', 'http://p2.music.126.net/CXxzpn5p5RnT6ni-im8Abw==/840026883626982.jpg');
INSERT INTO `singer` VALUES ('29843', 'Bob Sinclar', ' Bob Sinclar的真名是Christophe LeFriant，他是一个法国唱片公司的制作人、DJ和the label Yellow Productions厂牌的拥有者（和DJ Yellow共同拥有此厂牌）。Sinclar从1986年开始其DJ生涯，当时使用的艺名叫Chris The French Kiss，那时候他只有18岁，专攻Funk和Hip－hop音乐。他第一打碟的俱乐部是Gym & Tonic，同来自Daft Punk的Thomas Bangalter合作，用一段Jane Fonda 的正常录音做出了特别的不规则的vocals。 ', 'http://p2.music.126.net/0UyAKEtaAIhd1w9ARAQY1w==/821335185978182.jpg');
INSERT INTO `singer` VALUES ('29968', 'Calvin Harris', 'Calvin Harris是一位来自英国苏格兰的创作歌手、音乐制作人和DJ。在2007年他以单曲《Acceptable in the 80s》出道，开始引起主流媒体的注意。至今，他已发行了三张录音室专辑，并为许多国际巨星制作了多首热门单曲。2011年底，由Calvin Harris一手创作并制作，由巴巴多斯小天后Rihanna演唱的《We Found Love》获得了全球范围内的巨大成功，也为Calvin Harris迅速打开了知名度。现在他已是全球炙手可热的流行舞曲制作人，在2014年全球百大DJ排名中名列第11位。2015年5月，获得2015公告牌音乐奖最佳舞蹈/电子歌手。同年11月，发行第四张录音室专辑《Motion》。2019福布斯100名人榜排名第95位。2013年至2018年，他连续六年荣登福布斯全球薪酬最高DJ榜首。', 'http://p1.music.126.net/YSpmUEAfarPUy13YWOCdUA==/109951166044910506.jpg');
INSERT INTO `singer` VALUES ('30013', 'Chris Lake', 'Chris Lake (born 8 August 1982) is a British electronic music producer and DJ.', 'http://p2.music.126.net/GOhYzClKxW9lhT5fNtN84A==/379331511588973.jpg');
INSERT INTO `singer` VALUES ('30980', 'Claudio Arrau', '克劳迪奥·阿劳·利昂（西班牙语：Claudio Arrau León，1903年2月6日－1991年6月9日），智利钢琴家。他被认为是20世纪最伟大的钢琴家之一。他的演奏范围很广，从巴洛克到20世纪的古典音乐均有建树。录制了大量的唱片，是贝多芬、舒伯特、肖邦、舒曼、李斯特、勃拉姆斯作品的权威演奏家。阿劳在表现上追求纯正严谨的古典风格与深刻的感情之间的结合，在演奏中强调重音的效果，追求结构严谨与细腻情感表达的结合。阿劳演奏的贝多芬全套奏鸣曲，在唱片史中有相当的地位，其演绎以严谨与情感细腻著称。', 'http://p2.music.126.net/EZ8NhyOiVUfbQAP2asAH2w==/109951165964972677.jpg');
INSERT INTO `singer` VALUES ('32633', 'David Hoffman', '', 'http://p1.music.126.net/S4V3E-eLL-x3il3dMqLThA==/5929666209030774.jpg');
INSERT INTO `singer` VALUES ('32671', 'Elton John', '艾尔顿·约翰于1947年3月25日出生于英国伦敦市郊，英国著名流行音乐创作歌手，享誉盛名的顶级音乐艺术家，自幼学习钢琴课程。被誉为“英国乐坛常青树”。1994年为电影《狮子王》创作的歌曲《Can You Feel The Love Tonight》红遍全球，1997年，纪念戴安娜王妃创作的歌曲《Candle In The Wind》全球卖出3700万张，是史上最卖座的单曲。1999年，获得格莱美传奇奖。\n			', 'http://p2.music.126.net/wO9aX2OZc2mnnAXq7Ocp3g==/109951164087875448.jpg');
INSERT INTO `singer` VALUES ('33059', 'Edward Elgar', '爱德华·威廉·埃尔加爵士（英语：Sir Edward William Elgar，1857年6月2日－1934年2月23日），英国作曲家，代表作包括《谜语变奏曲》和《威仪堂堂进行曲》。\n\n埃尔加先是作为一位小提琴家而进入乐坛，他1882年起在斯托克利指挥的伯明翰交响乐团中任第一小提琴，早期创作主要是宗教合唱，如《圣体颂》（Ave，Verum Corpus，Op.2，作于1887年）、《圣歌》（Cantique，Op.3，作于1889年）。第一首在世界范围内获得声誉的作品就是《谜语变奏曲》（1899年由汉斯李希特指挥首演），随后，著名歌唱家克拉拉·巴特在诺里奇音乐节演唱《海景图》、康塔塔《杰隆修斯之梦》又连续获成功，以致理查·斯特劳斯称他是当时最重要的英国作曲家。\n\n埃尔加的创作特点在于把高雅的陈述与流行风格相结合，他的音乐外在表达亲切和蔼，而内里又隐藏着内省的抑郁，两者的融合并不是十分和谐。他对旋律的捕捉非常敏感，属于善于把握乐队技巧的大师之一，在合唱作品中，也善于控制合唱效果。埃尔加喜欢色彩变化，其作品中因充溢着太多的情感往往影响音乐本质的深度，但其中蕴含的丰富人道主义精神也冲破了英国音乐那种稳重、含蓄、有时有些沉闷的固定风格。埃尔加最有名的作品是《谜语》变奏曲、《威仪堂堂》进行曲和《大提琴协奏曲》，其实他最优秀的作品是其清唱剧，比如《杰隆修斯之梦》和《王国》。', 'http://p1.music.126.net/f-I6bKLVUWAG5h1jip97Og==/109951166504493538.jpg');
INSERT INTO `singer` VALUES ('33184', 'Ed Sheeran', '爱德华·克里斯多弗·希兰（Edward Christopher Sheeran）艺名艾德·希兰（Ed Sheeran），1991年2月17日出生于英国英格兰西约克郡，是大西洋唱片（Atlantic Records）旗下的一位歌手同时也是一位创作人。\n2011年6月，推出首支单曲《The A Team》荣获英国单曲榜第三名，同时该单曲在第55届格莱美颁奖典礼中被提名为年度最佳歌曲。2012年在第32届全英音乐奖中荣获英国最佳男艺人、英国最具突破艺人、英国最佳单曲和英国最佳专辑四项提名。\n2014年第二张专辑专辑《X》在英国销售达170万张。2015年在全英音乐奖颁奖盛典荣获“年度最佳男歌手”和“年度最佳专辑”两项大奖 。2016年2月，在第58届格莱美音乐奖获得年度单曲奖和最佳流行歌手奖。', 'http://p2.music.126.net/9dSF886oJ8RrVuHVcGqcMw==/109951166672913425.jpg');
INSERT INTO `singer` VALUES ('33737', 'Frédéric François Chopin', '弗雷德里克·弗朗索瓦·肖邦（法语：Frédéric François Chopin，1810年3月1日－1849年10月17日），波兰作曲家和钢琴家，他是历史上最具影响力和最受欢迎的钢琴作曲家之一，波兰音乐史上最重要的人物之一，也是欧洲19世纪浪漫主义音乐的代表人物。\n\n肖邦自幼喜爱波兰民族音乐，7岁时就创作了波兰舞曲，8岁登台演出，不足20岁已出名。肖邦39岁时因病英年早逝，后半生主要生活在法国，创作了大量钢琴作品，如4部叙事曲、十余部波兰舞曲（包括《军队》《英雄》），26首钢琴前奏曲（包括《雨滴》），27首钢琴练习曲（包括《离别》《革命》），4部谐谑曲、4部即兴曲、3部钢琴奏鸣曲、21首夜曲、59首马祖卡、2部钢琴协奏曲、幻想曲、大提琴奏鸣曲和摇篮曲等。\n\n肖邦一生的创作大多是钢琴曲，被誉为“钢琴诗人”。他在国外经常为同胞募捐演出，为贵族演出却很勉强。1837年严辞拒绝沙俄授予他的“俄国皇帝陛下首席钢琴家”的职位。舒曼称他的音乐像“藏在花丛中的一尊大炮”，向全世界宣告：“波兰不会亡”。他晚年生活非常孤寂，痛苦地自称是“远离母亲的波兰孤儿”。临终嘱附亲人把自己的心脏运回祖国。', 'http://p1.music.126.net/3POx0Qw_mQGp9h4ku1ELuA==/109951165885175311.jpg');
INSERT INTO `singer` VALUES ('33850', 'Glenn Gould', '格伦·赫伯特·古尔德（英语：Glenn Herbert Gould，1932年9月25日－1982年10月4日），加拿大钢琴家。被公认为是20世纪最著名的古典钢琴家之一，他同时也是一位管风琴家、广播节目主持人与作曲家，以演奏约翰·塞巴斯蒂安·巴赫乐曲而闻名于世。于31岁（1964年）以后停止公开演奏，转向录音和其他项目。\n\n古尔德的演奏曲目从巴赫到爵士乐无所不包，他录制了勋伯格的全部钢琴作品，但最出色的表现还在对巴赫的演绎上。古尔德在处理快速乐段和声部的力度层次方面有非凡的才能，只有他才能出色地表现出巴赫的赋格的层次与魅力，而他在处理慢速时，音粒似是一个一个跳跃出来，快速又是音粒飞溅，有眼花缭乱之感。古尔德是一个拒绝观众、专注于在录音中寻找表现的钢琴家，他兴奋时会边弹边哼，我们在唱片中经常听到他的这种“杂音”，但这丝毫也不损害他演奏的光辉。', 'http://p1.music.126.net/KZN6nrDB5j_iXUiZTR6Mcg==/109951165204805358.jpg');
INSERT INTO `singer` VALUES ('34221', 'Gil Shaham', '吉尔·沙汉姆（Gil Shaham，1971年2月19日－），美国小提琴家。沙汉姆属于炫技型的演奏家，有精湛的技巧，在表现技巧型（如帕格尼尼）和现代气息的作品（如普罗科菲耶夫）时，有相当的特色。', 'http://p1.music.126.net/7f6cfUctvoGIjZLSLWbE4g==/109951165964953887.jpg');
INSERT INTO `singer` VALUES ('34973', 'Herbert von Karajan', '赫伯特·冯·卡拉扬（德语：Herbert von Karajan，1908年4月5日－1989年7月16日），出生于萨尔斯堡，奥地利著名指挥家、键盘乐器演奏家和导演。卡拉扬在指挥舞台上活跃60 年。他带领过欧洲众多顶尖的乐团，并且曾和柏林爱乐乐团有过长达34年的合作关系。他热衷于录音和导演，为后人留下了大量的音像资料，包括众多的管弦乐，歌剧录音和歌剧电影，涵括从巴洛克，到后浪漫主义欧洲作曲家，甚至部分现代乐派的作品。其中一些作品，如贝多芬的交响曲还被多次录制。卡拉扬在音乐界享有盛誉，甚至在华文世界被人称为“指挥帝王”。', 'http://p2.music.126.net/lnmkN6kWa0HTMmxfUutnGg==/18567452859921170.jpg');
INSERT INTO `singer` VALUES ('35415', 'Janos Starker', '斯塔克·亚诺什（匈牙利语：Starker János，1924年7月5日－2013年4月28日），美国籍匈牙利裔大提琴家。\n\n斯塔克有高人的技巧，追求质朴、刚劲的演奏。他重新编订了巴赫的6首无伴奏组曲，强调了那种粗砺、刚劲的表达。他演奏的科达伊的奏鸣曲，把此曲技巧上的高难表现得游刃有余堪称绝活。而他在 Mercury录制的德沃夏克协奏曲，舒曼、拉罗、圣桑的协奏曲，都是他最成熟时期的丰硕成果。', 'http://p1.music.126.net/b0LDrmkhxg3IMDO7zj0dgw==/109951165904619059.jpg');
INSERT INTO `singer` VALUES ('36134', 'Junior Jack', '', 'http://p2.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('36490', 'Johann Sebastian Bach', '约翰·塞巴斯蒂安·巴赫（德语：Johann Sebastian Bach，1685年3月31日〔儒略历3月21日〕－1750年7月28日），巴洛克时期的德国作曲家，管风琴、小提琴、大键琴演奏家，也是巴洛克音乐的集大成者。巴赫被认为是音乐史上最伟大、最杰出、最重要的作曲家之一。\n\n巴赫出生于德国中部图林根州小城艾森纳赫的一个音乐世家，在有生之年是一位著名的宫廷乐长，在德国莱比锡圣多马教堂度过了最后27年的时间。\n\n巴赫把西欧不同民族的音乐风格融为一体。他集意大利、法国和德国传统音乐中的精华，曲尽其妙，珠联璧合，天衣无缝。\n\n巴赫自己在一生中并未享有盛名，而且在死后五十年中就已被世人遗忘。但是在近一个半世纪中他的名气却在不断地增长，一般认为他是西方音乐史中最伟大的两三位作曲家之一，而且有些人认为他是其中最伟大的作曲家。\n\n巴赫的知名作品有《平均律钢琴曲集》《勃兰登堡协奏曲》《管弦组曲》《b小调弥撒》《无伴奏大提琴组曲》《马太受难曲》《圣诞神剧》《赋格的艺术》《哥德堡变奏曲》《无伴奏小提琴奏鸣曲与组曲》。', 'http://p1.music.126.net/tPLNdMUrH7mphFL5i6rbYw==/109951166460069131.jpg');
INSERT INTO `singer` VALUES ('36640', 'Jeno Jando', '简诺·扬多（匈牙利语：Jandó Jenő，1952年2月1日－），匈牙利钢琴家，布达佩斯李斯特音乐学院教授。', 'http://p1.music.126.net/rbespq36lqsQIddBZJwZjw==/109951165921253153.jpg');
INSERT INTO `singer` VALUES ('37088', 'John H. Clarke', '美国著名民间吉他艺人，以弹奏西班牙古典吉他而闻名。目前出版了两张专辑《Acoustik Guitar》和《Classical & Spanish Guitar》。', 'http://p1.music.126.net/NHjYKnb-UntVM4aRQeSqRQ==/5959353022973296.jpg');
INSERT INTO `singer` VALUES ('37296', 'Julian Lloyd Webber', '朱利安·劳埃德·韦伯（英语：Julian Lloyd Webber，1951年4月14日－）是英国大提琴独奏家，他被称为“英国最资深大提琴演奏家”。', 'http://p1.music.126.net/gtcDvvHTNr6vmOb8DvSgqg==/840026883626979.jpg');
INSERT INTO `singer` VALUES ('37997', 'Krystian Zimerman', '克里斯蒂安·齐默尔曼（波兰语：Krystian Zimerman，1956年12月5日－），波兰钢琴家和指挥家。出生于波兰扎布热，是现今公认世界上最杰出的钢琴家之一，曾于1975年获得第九届肖邦国际钢琴大赛首奖。齐默尔曼兼具浪漫气质与精湛的技巧，其演奏的肖邦清新而最具特色。他以诠释浪漫主义音乐见长，但亦广泛演奏古典主义作品，此外也非常支持现代音乐的发展，也录制一些浪漫主义和印象派的独奏作品。', 'http://p2.music.126.net/DntSPXLpTc40F6rfmA_TgQ==/3265549615432821.jpg');
INSERT INTO `singer` VALUES ('38127', 'Ludovico Einaudi', '意大利钢琴家和作曲家 Ludovico Einaudi 鲁多维科·艾奥迪 1955年出生于意大利都灵，他的母亲也是一位钢琴家，从小就受到了钢琴音乐的熏陶。在米兰音乐学院学习时获得了意大利著名的作曲家、指挥家和音乐教育家 Luciano Berio 卢西恩·贝利奥 的指导，并获得了作曲学位。他的音乐总被认为是容易接近和可信的，被描述为最低纲领主义者，古典，氛围，当代和深动感人的受欢迎的声音，曲风深受巴哈、莫扎特、肖邦等音乐家的影响，古典大气而不乏现代感。', 'http://p1.music.126.net/O3NRzAxuj-5-EQc3c_wmUQ==/109951163007707637.jpg');
INSERT INTO `singer` VALUES ('38130', 'Lasse Lindh', 'Lasse Lindh，瑞典Indie Pop歌手，出生于1974 年 3 月。在瑞典，Lasse Lindh就是大牌级人物，16岁就开始组建乐队，曾经也签署于瑞典著名唱片Labrador，至今为止发行了7张专辑，1张EP，1张单曲（2007年4月），带有浓重Indie-pop风格，流行味十足的痛苦情歌，以优美的方式诉说悲伤，时而郁闷压抑时而情绪高涨，让人沉迷在他美妙嗓音和悦耳旋律之中；温暖的钢琴和失真吉他声交织缠绵在一起。总体说来，Lasse Lindh的风格倾向于悲伤和近乎于崩溃的吉他流行曲，与美国的EMO一派颇为相似，但难能可贵的是他还是避免了美国的那种极端的心碎和搔首弄姿般的顾影自怜。', 'http://p2.music.126.net/FpjBS8to3V2jJDElTjYywA==/846623953408959.jpg');
INSERT INTO `singer` VALUES ('38731', 'Ludwig van Beethoven', '路德维希·范·贝多芬（德语：Ludwig van Beethoven，1770年12月16日－1827年3月26日），德国作曲家、钢琴演奏家，维也纳古典乐派代表人物。贝多芬上承古典乐派传统，下启浪漫乐派之风格与精神，因而在音乐史上占有非常重要的地位，他是历史上最具影响力和最受欢迎的作曲家之一。自1814年开始，他的听力急剧下降，于是放弃了钢琴演奏和指挥，但却坚持创作。贝多芬一生共创作了9首编号交响曲（其中第三号“英雄”、第五号“命运”、第六号“田园”第七号、第九号“合唱”尤为著名）、36首钢琴奏鸣曲（其中32首带有编号，1首未完成）、5首钢琴协奏曲、1首小提琴协奏曲、10部小提琴奏鸣曲、16首弦乐四重奏、1部歌剧及2部弥撒曲等等。这些作品对音乐发展有着深远影响，贝多芬因此在华语世界中被尊称为“乐圣”。', 'http://p2.music.126.net/iEBu3AGqh4C-3wW-_lT8JQ==/109951165867914165.jpg');
INSERT INTO `singer` VALUES ('38858', '马友友', '马友友（Yo-Yo Ma，1955年10月7日－），祖籍浙江鄞县，生于法国巴黎，美籍华裔大提琴演奏家，曾获得多座格莱美奖。马友友的演奏追求细腻的表达与抒情，追求美妙的音质和自然、清新，他的琴声往往是一种感情倾诉。其演奏的德沃夏克协奏曲，以浸透了浪漫伤感而格外感人，他在处理舒曼的《民间风格小曲》、《柔板与快板》、《幻想曲》时，充分体现出温柔和抒情，而他拉的巴赫6首无伴奏组曲，也以他自己的方式，使其细致而情感化。', 'http://p2.music.126.net/GCcrTVZhUofbfH6Ysz4EIA==/652010395274911.jpg');
INSERT INTO `singer` VALUES ('38956', 'Michael Hoppé', 'Michael Hoppe, 一个获得格莱美奖提名的旋律天才，在流行和古典音乐都有广泛的背景；反映在他多样的唱片品牌和作品上。他的音乐在国际间和众多的节目中被聆听，从HBO的“女高音”到Oprah Winfrey Show。 ', 'http://p2.music.126.net/cE5aGQGpQlgMWZvLpWoP4g==/5985741302105670.jpg');
INSERT INTO `singer` VALUES ('40049', 'Maurizio Pollini', '毛利齐奥·波里尼（Maurizio Pollini，1942年1月5日－），意大利钢琴家。9岁登台，后师从维杜索，1959年毕业于米兰音乐学院，1957年在米兰演奏肖邦练习曲引起注意，1960年参加第六届国际肖邦比赛，获第一名，之后又拜米凯兰杰里为师继续深造，1972年起在基贾娜学院钢琴高级班任教。波里尼善于演奏幅度、力度较强的作品，比如贝多芬。他演奏的贝多芬，无论协奏曲与奏鸣曲，都洋溢着理性的光辉；他演奏的普罗科菲耶夫的奏鸣曲，如同滤去了浮躁的情感，与俄罗斯演奏家的演奏恰成对比。波里尼追求触键的准确、清晰，有“如在无菌室中培养出来的清洁”之称，因为追求理想而常常摒弃感性在演奏中的作用，所以他演奏贝多芬钢琴奏鸣曲的效果远不如吉列尔斯，表现的肖邦也往往过于“坚硬”而流畅、刚柔对比不够。', 'http://p2.music.126.net/o5LDFIrrs7plM15NFcjJfQ==/557452395302898.jpg');
INSERT INTO `singer` VALUES ('43746', 'Salvatore Accardo', '萨尔瓦托雷·阿卡多（意大利语：Salvatore Accardo，1941年9月26日－），意大利小提琴家、作曲家，以其帕格尼尼作品诠释而闻名。', 'http://p1.music.126.net/UE0MsFs6AouwpML0oE6M9w==/109951165964958875.jpg');
INSERT INTO `singer` VALUES ('45376', 'Jorge Bolet', '乔治·博列特（Jorge Bolet，1914年11月15日－1990年10月16日），美国古巴裔钢琴家。12岁获美国科蒂斯音乐学院奖学金到该院留学，在萨佩顿(Saperton)班学钢琴，1932-1933年师从戈多夫斯基，1935年拜罗森塔尔为师，接着又从鲁道夫·塞尔金深造。1937年举行独奏会而崭露头角，1938年获霍夫曼钢琴比赛奖，二战中参军，战后继续演奏生涯。博列特被称为浪漫乐派钢琴演奏家的最后代表，他的演奏是抒情与狂想的很好结合，被称为“李斯特的代表”。博列特在Decca录制的9张李斯特作品选集是其代表唱片。他演奏戈多夫斯基改编的肖邦练习曲，也是极为精彩的录音。', 'http://p1.music.126.net/GzBxU7qcQp2MZfXvDZML4Q==/109951165920496770.jpg');
INSERT INTO `singer` VALUES ('45688', 'Vladimir Horowitz', '弗拉基米尔·萨莫伊洛维奇·霍洛维茨（英语：Vladimir Samoylovich Horowitz，俄语：Владимир Самойлович Горовиц，1903年10月1日－1989年11月5日），美国俄裔钢琴家，一生获24个格莱美奖。\n\n就学于基辅音乐学院，毕业后在哈尔科夫举行了15次独奏会，正式开始演奏生涯，1924-1925年以11台不同曲目的演奏共23场，声名大噪。1928年到伦敦，接着到纽约，因在比彻姆指挥纽约爱乐乐团演奏柴科夫斯基《第一钢琴协奏曲》中的出色表现而真正在世界范围内成名。1933年，他开始与托斯卡尼尼合作贝多芬的钢琴协奏曲，在更大范围获得了世界声誉，不久与托斯卡尼尼的女儿结婚，1940年定居美国，1944年入美国籍。霍洛维茨曾多次从舞台退隐，最长的一次是从1953年至1965年，他以神经系统受损害为由，整整12年不再露面，潜心于研究克莱门蒂的作品。1965年5月9日，他在卡内基音乐厅重返舞台，举行一系列音乐会，4年后再度退隐，直至1974年才再度出山。1986年在他82岁高龄时重返苏联，于莫斯科和列宁格勒各举办了一场音乐会。\n\n霍洛维茨是一个有争议的钢琴家，因为他的演奏极端追求表情与效果。在技巧方面，他对速度和力度的控制出类拔萃，尤其是在八度表达上，有惊人的能力，既能发出铿锵有力的金属声音，又有梦幻般的柔美音色；他擅长强音，擅长制造快速的音效，追求美妙的连音效果，他强调的是极端的对比和极端的表情，他的演奏能创造最出色的效果。霍洛维茨最擅长挖掘类似舒曼、肖邦、斯克里亚宾、拉赫玛尼诺夫、克莱门蒂等作曲家的神秘因素，他演奏的舒曼的《童年情景》、《克莱斯勒偶记》、《梦幻曲》以及斯克里亚宾与克莱门蒂的奏鸣曲、拉赫玛尼诺夫的前奏曲与练习曲都有极强的造型感。晚年他醉心于莫扎特，但他的莫扎特是极端效果化的莫扎特，他认为他对作品效果的追求，是他的音乐创造。', 'http://p2.music.126.net/IsvvsiepmzS1P2STsGf3cA==/109951165964977540.jpg');
INSERT INTO `singer` VALUES ('45746', 'Vladimir Ashkenazy', '弗拉基米尔·达维多维奇·阿什肯纳齐（俄语：Влади́мир Дави́дович А́шкенази、冰岛语：Vladímír Ashkenazy，1937年7月6日－），又译阿什克纳济，冰岛籍俄罗斯钢琴家、指挥家。阿什肯纳济作为俄罗斯钢琴家，感情充沛，追求表达的抒情性、诗意与浪漫气质，作为奥伯林的学生，又有莫斯科学院派那种不同于德奥学院派的严谨。阿什肯纳济的最突出长处是其手指的高超技巧，而在音色上比起类似里赫特这样的俄罗斯钢琴家略逊一筹。阿什肯纳济演奏曲目极广，但其长处还是在表现俄罗斯作曲家，尤其是拉赫玛尼诺夫与斯克里亚宾的作品中。他与帕尔曼、哈雷尔组成的三重奏，在演奏柴科夫斯基的室内乐作品中体现了自己的特色。', 'http://p2.music.126.net/BgnHqZe-Gf9hA_QNpoExew==/109951164090164477.jpg');
INSERT INTO `singer` VALUES ('46547', 'Anne-Sophie Mutter', '安娜-苏菲·穆特（德语：Anne-Sophie Mutter，1963年6月29日－），著名德国女小提琴演奏家。', 'http://p1.music.126.net/vQ8vCLkQGmRQjXmIS7gC3Q==/818036651073965.jpg');
INSERT INTO `singer` VALUES ('55350', 'Deep Side', 'Deep Side，(目前已改名为\"Git Fresh)是一支来自美国迈阿密的R&B + Hip-Hop 团体，四名成员分别为：Rudy (Rude Boi), Brent Pendergast (Penny), Mike Espinosa (Mike Ezay), 和Sly (Pretti Sly)。建团最初，成员都还是青春迸发的少年，怀着一颗满载理想的雄心踏上这条与音乐相关的远征路。很幸运他们的才华得到了大牌公司“Jive Records”的赏识，随后便首推第一张同名的大碟，不过在这之后6年里组合便没有大动作，直到加盟了新唱片公司，Deep Side重出江湖，更名以\"Git Fresh\"为头衔发布了新专辑\"Git Fresh\"，单曲\"Booty Music\"更是火得一塌糊涂，各种版本相继推出，让歌迷再次领略到了Deep Side的风光魅力。', 'http://p2.music.126.net/vaiGEtVwLpHCrXp1hLYSyw==/5997835929942840.jpg');
INSERT INTO `singer` VALUES ('56598', 'Ellie Goulding', 'Ellie Goulding（1986年12月30日－）英国唱作女歌手。她是“2010 BBC年度之声”最高票选得主，并得到2011年全英音乐奖评委的一致青睐，从此后便累积大量人气，名气与之俱增。2009年签约Polydor唱片公司，同年发行自己第一弹延伸剧目《An Introduction to Ellie Goulding》，接下来在2010年发行了第一张录音室专辑《Lights》以及改版专辑，重新更名为“Bright Lights”。英国卫报形容Ellie Goulding的歌声仿佛是空灵乐派的Cocteau Twins乐团唱起了流行乐的感觉，给听众带来新鲜的感觉！第二张录音室专辑《Halcyon》2012年10月5日正式发行。\n', 'http://p1.music.126.net/u5Z5sgV1ga1ZG4zohE6kuQ==/109951165006818703.jpg');
INSERT INTO `singer` VALUES ('60310', 'Ingrid Haebler', '海布勒Ingrid Haebler 1929-奥地利女钢琴家，父母为波兰人，11岁在萨尔茨堡公开演奏，在萨尔茨堡莫扎特音乐学院学习，后进维也纳音乐学院、日内瓦音乐学院、巴黎音乐学院深造，是玛格丽特·隆班上的学生。1952年参加日内瓦国际钢琴比赛获二等奖，1954年参加慕尼黑国际钢琴比赛和日内瓦舒伯特钢琴比赛，均获一等奖。海布勒的演奏追求一种清新、清纯的效果，追求音色的微妙层次区分与音阶性经过句中颗粒型音色的效果。海布勒好像天生是为演奏莫扎特而出生的，她从小在莫扎特的氛围中长大．她演奏的莫扎特，无论是协奏曲、奏鸣曲还是小品，都被认为是最有味道的莫扎特。她所演奏的舒伯特全套奏鸣曲以及与格吕米奥三重奏团合作的《鳟鱼》．也被认为是最有味道的舒伯特。', 'http://p2.music.126.net/iLvH_IeJSjopSEfY5CWn4Q==/109951163752884172.jpg');
INSERT INTO `singer` VALUES ('62627', 'Jacqueline du Pré', '杰奎琳·玛丽·杜·普蕾（法语：Jacqueline Mary du Pré，1945年1月26日－1987年10月19日），英国大提琴演奏家。杜·普蕾的演奏技巧十分全面，歌唱性旋律表现迷人，音色变化丰富多彩。她最出色的演奏就是对埃尔加协奏曲的处理，她最珍贵的录音是1971年与巴伦勃伊姆合作的肖邦和弗兰克（由小提琴奏鸣曲改编）的大提琴奏鸣曲，这是她的最后录音。', 'http://p1.music.126.net/BZAAWq5FcwiWZ2aC3Fyblg==/793847395254553.jpg');
INSERT INTO `singer` VALUES ('63650', 'Kathleen Battle', '凯瑟琳·迪安娜·芭特尔 (英语原名: Kathleen Deanna Battle) 生于1948年8月13日，是美国歌剧乐坛上知名的轻抒情花腔女高音(light lyric-coloratura)，以的她银玲般甜蜜轻巧的音色而闻名乐坛。最初在20世纪70年代早期和中期芭特尔通过与各大乐团合作演出女高音作品而知名。1975年首次出演歌剧并在20世纪80年代和90年代出演众多歌剧中的抒情女高音和花腔女高音角色。如今，虽然芭特尔不再频繁出现在歌剧剧目中，但她仍然活跃在音乐会和独唱演出中。', 'http://p1.music.126.net/fbHcVYeDL58LrMRoU1SnJg==/8900546627195958.jpg');
INSERT INTO `singer` VALUES ('66396', 'Martha Argerich', '玛尔塔·阿格里奇（西班牙语：Martha Argerich，1941年6月5日－），阿根廷钢琴家。第七届肖邦国际钢琴比赛首奖得主，被视为当代最伟大的钢琴大师之一。\n\n5岁首次登台，1946年师从斯卡拉穆扎（Scaramuzza）接受严格训练，1955-1957年在维也纳师从古尔达，后又在日内瓦拜李帕蒂夫人和马加洛夫为师。1957年获布梭尼国际钢琴比赛奖、日内瓦国际钢琴比赛一等奖。1960年从米凯兰杰利继续深造，1965年在华沙第七届国际肖邦钢琴比赛中获一等奖，波兰唱片公司在现场录制了她演奏的肖邦《第一钢琴协奏曲》的唱片，一下子使她名扬四海。阿格里奇曾两次退出舞台，但每次重返舞台就显示出种对自己的超越。阿格里奇的演奏充分展示出她的吉卜赛奔放、热情的性格，她以女性少有的有力触键以及对速度的敏感把握，在表达中显示出极亮丽的音质。阿格里奇善于表达情感充沛、能充分体现色彩感的作品，诸如肖邦、柴科夫斯基这类作曲家的丰富情感表达，在她的演绎下都能呈现出极夺目的光彩。她善于在乐队衬托下，被乐队刺激出激情，所以其协奏曲一般都好于独奏曲与室内乐。当然，也有例外，她演绎的肖邦《船歌》和舒曼的《童年情景》，可以说是最有味道的解读。', 'http://p2.music.126.net/y6nbeUaHeMo8fVb88Dx9LQ==/900500023154525.jpg');
INSERT INTO `singer` VALUES ('67664', 'Mark Knight', 'Mark Knight is a leading player in dance music culture. His rise to the forefront has been more than just gigs and remixes; his contribution to the scene via his label Toolroom Records, demonstrates abilities that supercede the glorified title of ‘DJ’', 'http://p2.music.126.net/VBRcKK6VE1RWERCV5XFnlA==/462894395300600.jpg');
INSERT INTO `singer` VALUES ('70638', 'Oxia', 'Oxia 原名Olivier Raymond，是法国电子音乐舞台上的先锋，他以擅长制造深厚的和富有旋律的声音而闻名。他的小专辑及重新编曲使得他成为2000-2010年间的重要制作人。', 'http://p1.music.126.net/PlyY9bZ6e63wucz3vm6i_w==/236394999993026.jpg');
INSERT INTO `singer` VALUES ('72609', 'Pascal Rogé', '帕斯卡·罗杰（Pascal Rogé，1951年4月6日－），法国钢琴家。\n帕斯卡·罗杰在9岁进入巴黎高等音乐院学习，师从迪卡芙（Lucette Descaves），并曾获美国钢琴家卡钦的指导。帕斯卡·罗杰在16岁得到罗马尼亚恩奈斯可钢琴大赛冠军，20岁得到隆-提博大赛冠军。\n帕斯卡·罗杰是一位唯美主义者，他的演奏触键精致细腻，声音清澈透亮，在表现法国印象派作品时，其轻灵雅致、朦胧与虚幻的意境极为迷人，其诠释的圣桑、弗雷、萨蒂等人的作品，都极有意境。', 'http://p2.music.126.net/wROcwjyVzAoLSSADPTeQvg==/109951165787113673.jpg');
INSERT INTO `singer` VALUES ('74625', 'Sia', 'SiA，全名Sia Kate Isobelle Furler.生于1975年12月18日，澳大利亚。父母均从事音乐工作，\"I only owned 2 CDs: a Jackson 5 anthology and Jeff Buckley\'s Grace.\"SiA在真正从事音乐之前，她听的音乐真的很少很少。因为在和Zero 7一起巡回演出之后，SiA才非常认真的去听各种不同的音乐作品。', 'http://p1.music.126.net/KLyFXQiVlA0OuD6bnBcrTw==/109951165434732124.jpg');
INSERT INTO `singer` VALUES ('74843', 'Sara Nusara Poongprasert', '泰国一名老姐类歌手，歌曲均能首首唱到经典，现在已经退出歌坛了。', 'http://p1.music.126.net/zYV5bCAH_9Y8o__LXVtJ3Q==/5796625301871947.jpg');
INSERT INTO `singer` VALUES ('77564', 'Sviatoslav Richter', '斯维亚托斯拉夫·特奥菲洛维奇·里赫特（Sviatosláv Teofílovich Ríkhter，又译里希特或李希特，1915年3月20日－1997年8月1日），乌克兰德裔钢琴家。里赫特被公认为是20世纪最伟大的钢琴家之一，他以极广的曲目范围，举重若轻的技术以及富有诗意的分句闻名。', 'http://p2.music.126.net/H0G9Ga7DBTh21fvbKGuHIg==/683896232488487.jpg');
INSERT INTO `singer` VALUES ('86032', 'Academy of St. Martin in the Fields', '圣马丁室内乐团（英语：Academy of St Martin in the Fields），世界著名室内乐团之一，乐队名称来自于乐队早期演出的地点——伦敦圣马田教堂。圣马丁室内乐团于1958年创立，最初是一支由伦敦交响乐团成员组成的弦乐队，在乐季休息期间在无指挥的情况下演奏巴洛克音乐。不久后加入了管乐演奏员，由内维尔·马里纳爵士接过指挥一职。马里纳一直担任乐队终身主席（Life President），直至2016年逝世。\n\n穆雷·佩拉西亚自2000年来担任首席客座指挥，约夏·贝尔2011年起担任音乐总监。\n\n圣马丁室内乐团现今不仅演奏巴洛克音乐，也涉足浪漫主义音乐和当代古典音乐。乐队是有史以来录音最多的室内乐团，有超过500张唱片，他们还录制了《莫扎特传》、《英国病人》和《泰坦尼克号》等电影的配乐。', 'http://p1.music.126.net/enBp-rTjuMZA1ce7MAyLqw==/1390882223055943.jpg');
INSERT INTO `singer` VALUES ('93082', 'F.O.O.L', '', 'http://p1.music.126.net/iQmRI5VKm7IfoRndFnKPqw==/6620159511128799.jpg');
INSERT INTO `singer` VALUES ('94779', 'Imagine Dragons', 'Imagine Dragons，美国独立摇滚乐队，由主唱丹·雷诺斯、贝斯手本·麦基、吉他手韦恩·瑟蒙和鼓手丹尼尔·普拉兹曼组成。\n2008年，该乐队在拉斯维加斯成立；同年，发行首张EP《Speak to Me》。2012年，发行首张录音室专辑《Night Visions》，专辑内的单曲《Radioactive》在公告牌百强单曲榜创下了87周的在榜纪录。2014年，凭借歌曲《Radioactive》获得第56届格莱美奖最佳摇滚表演奖；同年，献唱网络游戏《英雄联盟》全球总决赛主题曲《Warriors》和《变形金刚4》电影主题曲《Battle Cry》。2015年2月，发行第二张录音室专辑《Smoke + Mirrors》。2017年6月，发行第三张录音室专辑《Evolve》，该专辑入围了第60届格莱美奖最佳流行专辑奖；11月，获得第45届全美音乐奖最受欢迎流行或摇滚组合奖。2018年1月，凭借歌曲《Thunder》入围第60届格莱美奖最佳流行团体或组合表演奖；5月，获得第25届公告牌音乐奖最佳组合或乐队奖、最佳摇滚艺人等四个奖项；11月，发行第四张录音室专辑《Origins》。2019年，获得第26届公告牌音乐奖最佳摇滚艺人奖。', 'http://p1.music.126.net/_yDVvfmDLOTPxkQ_vCKVDg==/109951166366047050.jpg');
INSERT INTO `singer` VALUES ('95186', 'Jaded', '英国电子音乐组合Jaded', 'http://p1.music.126.net/r5EUU4WCipawHE2pZSbJbA==/19140298416326061.jpg');
INSERT INTO `singer` VALUES ('97240', 'Mwk', 'Hardcore Techno, Drum\'n Bass, Dubstepなど電子音楽を中心に作曲してます。綺麗でエモいのが好物。甘いものも好物。最近はVOCALOIDもよく使います。', 'http://p2.music.126.net/dUQwYn4YjnqhVrQYx277KQ==/109951165547584018.jpg');
INSERT INTO `singer` VALUES ('100095', 'Soft Cell', '1980年，艺术学生马克•阿尔蒙德和戴夫•鲍尔在英国利兹成立了软细胞合唱团，这是一个以独特的低俗电子音乐而闻名的合成流行乐组合。最初，歌手阿尔蒙德和合成器演奏者鲍尔联手为戏剧作品创作音乐，作为软细胞合唱团，他们的现场表演继续大量借鉴戏剧和视觉艺术中的结对背景。一部名为《突变时刻》的自费电影引起了一些Bizzare唱片公司负责人Stevo的注意，他聘请丹尼尔•米勒在第二年制作了他们的地下热门单曲《纪念品》。 1981年的《污染的爱》是软细胞合唱团的下一部作品，它让这两人在国际上声名鹊起；这首歌由四年级预科生埃德•科布创作，由于格洛丽亚•琼斯深情的阅读，它已经成为一首受崇拜的歌曲，被重新发明为一首催眠的电子挽歌，成为今年最畅销的英国单曲，也是国外的一首热门歌曲。该团体的首张唱片《不停的色情歌舞》也非常成功，随后是1982年的混音专辑《不停的狂喜之舞》。 虽然1983年的《分崩离析的艺术》被证明与其前身一样受欢迎，但LPs的标题广泛地暗示了困扰这两部作品的内部问题；在1984年《昨夜在所多玛》上映之前，软细胞合唱团已经分手了。杏仁立即形成了电子灵魂单位马克和曼巴蛇；另一个乐队，马克•阿尔蒙德和心甘情愿的罪人，紧随其后，这位歌手最终在80年代末开始了自己的独唱生涯。经过多年的相对不活跃，鲍尔后来在技术装备网格中重新露面。', 'http://p2.music.126.net/J3aJfyIxEWYGvWjxAGXSmA==/484884627856256.jpg');
INSERT INTO `singer` VALUES ('102141', 'The Human League', 'The Human League是一个在1977年成立于英国谢菲尔德的流行乐队。在80年代初乐队阵容发生重大变化后，受欢迎程度迅速提升。从整个80年代至今，他们一直在录音、表演，并取得巨大成功。', 'http://p2.music.126.net/olCjNC2KH_GjH1SdjFpiEg==/771857162705280.jpg');
INSERT INTO `singer` VALUES ('102954', 'The Glitch Mob', 'The Glitch Mob是成立于2006年来自美利坚的三人电音团体，成员分别为Edit，Kaddy和Ooah，他们之前各自都发行过多张专辑。他们有着自己对音乐的独到理解，以及控制调节节奏营造氛围的天份，创作出了动感十足、节奏感强烈的电子曲风，前前后后出过不少单曲。他们的音乐充满了张力和活力洋溢的年轻气息，常常被运用于电影配乐、游戏音乐、舞蹈编排和各种热力四射的场合。', 'http://p2.music.126.net/zlVToYrzAQEuBaGemdUmJA==/109951165081214100.jpg');
INSERT INTO `singer` VALUES ('103557', 'Tafelmusik', '塔菲尔巴洛克古乐团（Tafelmusik Baroque Orchestra，也简称为Tafelmusik）是加拿大巴洛克乐团，专门演奏早期音乐，总部设在多伦多。他们经常使用合唱和演奏乐器的方式演出。\n\n该管弦乐队由反对派Kenneth Solway和巴松管演奏家Susan Graves于1979年创立。小提琴家Jeanne Lamon从1981年到2014年担任音乐总监。Lamon随后担任首席艺术顾问，直到2017年意大利小提琴家Elisa Citterio被任命为新的音乐总监。Lamon继续以较低的身份与管弦乐队一起演出和巡演。\n\n该管弦乐队有19名全职成员，专门从事历史表演和技术，并在需要时与其他音乐家一起加入乐团。', 'http://p1.music.126.net/tpNb_kJz-n9zSkJQnkdxsA==/109951164079628305.jpg');
INSERT INTO `singer` VALUES ('103673', 'Teenage Mutants', '德国电子组合 Teenage Mutants', 'http://p2.music.126.net/UKklVe9VDJRzbC0_AloNEw==/109951164192660127.jpg');
INSERT INTO `singer` VALUES ('104700', 'Various Artists', '', 'http://p2.music.126.net/TaLYS8fpQcBA70eUorkmCQ==/1395280263661923.jpg');
INSERT INTO `singer` VALUES ('105286', 'Wiener Philharmoniker', '维也纳爱乐乐团（Wiener Philharmoniker，VPO）是目前最顶尖的古典交响乐团之一，成立于1842年，以纯正的德奥风格以及细腻美妙的音色闻名于世。乐团成员均来自维也纳国家歌剧院（Wiener Staatsoper），乐团常驻地为著名的维也纳音乐之友协会大厅（即“金色大厅”）。', 'http://p1.music.126.net/G-86Vk3yidhgEhd-Ez9B7g==/109951166111360463.jpg');
INSERT INTO `singer` VALUES ('106157', 'Gun Napat', 'Gun Napat Injaiuea，1990年10月23日出生，泰国歌手、演员。2010年参加泰国THE STAR6 选秀比赛获得冠军，成为泰国超人气的歌坛新人。主要作品有泰剧《云中宝座》《船屋》《日落湄南河》等。', 'http://p2.music.126.net/SilkIXhndxq4udqkSAYbNQ==/109951165644755356.jpg');
INSERT INTO `singer` VALUES ('106600', 'Ten Nararak', '', 'http://p2.music.126.net/Y6Row2fV5QGJdq802TP2Ug==/3286440257902054.jpg');
INSERT INTO `singer` VALUES ('122455', '群星', '', 'http://p2.music.126.net/HnrjpF8WyWqxgsvOEqPaWw==/3261151501061433.jpg');
INSERT INTO `singer` VALUES ('123641', '辉星', '在韩国快速窜起的新生代R&B天王“辉星”（WHEESUNG），其表现不仅获致从乐迷到音乐工作者的全面肯定，并得到饶舌天皇徐泰智（Seo Taiji）与情歌之王申升勋（Shin Seung Hun）的背书推荐，单凭首张专辑便已获得“韩国的Brian Mc K night”的封号，其个人网站也写下了二十日内百万人次登入的空前流量，出道声势凌驾所有韩国当今天王天后，是只手创造韩乐优质新世代的超级新男声。', 'http://p1.music.126.net/KTzg4kfXbuSN_huJcM6F2A==/109951163049264906.jpg');
INSERT INTO `singer` VALUES ('123813', 'Jami Soul', '韩国男歌手', 'http://p1.music.126.net/eanP6H33Tu1I3PmZY4ZvdA==/109951163637337878.jpg');
INSERT INTO `singer` VALUES ('123825', 'July', 'July，本名李东勋，是韩国歌手、作曲家。1980年2月6日出生于韩国釜山广域市，曾经就读于韩国梁山大学建筑设备系，中途辍学。July于2006年1月23日发行了个人第一张专辑《旧爱》，现在所属社为digitalrecord。', 'http://p1.music.126.net/riqcGiqW9IV46wHxmzrSeg==/767459116209516.jpg');
INSERT INTO `singer` VALUES ('124026', 'KCM', 'KCM，韩国歌手，代表作品：《爱你至死不渝(Feat. Soul Dive)》《太阳的眼泪》《Smile Again》。', 'http://p1.music.126.net/IVZR4ziRdD0Vzo3CIY0TuQ==/666304046454886.jpg');
INSERT INTO `singer` VALUES ('124097', 'Yiruma', '李闰珉在韩国出生英国长大，曾就学于英国伦敦\'The Purcell School\' 特别音乐学校，后来毕业于 \'King\'s College of London University\' ，主修作曲。在他的音乐作品里，展现了兼融东方的抒情与西方的典雅细致的音乐风格。因主修古典钢琴与作曲，Yiruma展现他傲人的古典才情与欧洲人善感的特质；同时，纯净与清新的东方特色也呈现在他的音色里。藉由细致的音乐性探触，他精致的演奏技巧，予人一种非凡艺术家的深刻印象。YIRUMA是韩国偶像剧大导尹锡湖御用钢琴手。代表作品：《Love Scene》《First Love》《Kiss The Rain》', 'http://p2.music.126.net/VjoFMSiKmpxkx76zs9IOsQ==/7850513023495609.jpg');
INSERT INTO `singer` VALUES ('124470', 'October', 'October（악토버）(原名:곽민호) ，于1995年2月3日出生首尔，是韩国New Age钢琴演奏家和作曲家。', 'http://p2.music.126.net/Pk4zj48v0EH8moaOgPVV2g==/5929666209030782.jpg');
INSERT INTO `singer` VALUES ('124492', 'PSY', '朴载相，艺名PSY，别名鸟叔，出生于1977年12月31日，毕业于美国伯克利音乐学院，2001年正式的出道，2010年8月签入YG Entertainment，是韩国很著名的R&B实力派歌手，“鸟叔”之名大概是源自于他2001年1月18日发行的正式一辑《PSY来自神经质的世界》中的歌曲《鸟》，这首歌当时在席卷韩国，让鸟叔人气飙升。让鸟叔真正在全球火起来的，是2012年的《江南Style》，2012年11月8日，韩国歌手PSY的《江南Style》获得了吉尼斯认证,打破youtube吉尼斯世界纪录.被评为史上最多网民“Like”数最多的视频。2013年，朴载相推出单曲《绅士》。2014年6月，朴载相与饶舌歌手Snoop Dogg携手合作了《HANGOVER》 。2015年7月，发行个人第七张正式专辑。2017年5月10日，发行第8张正规专辑《4X2=8》。', 'http://p1.music.126.net/z99zyKqj7L-yMjf3Loe-5Q==/109951166214543571.jpg');
INSERT INTO `singer` VALUES ('124542', '朴宰范', '朴宰范（正确中文译名为朴载范）美籍韩裔，韩国最大艺人公司 SidusHQ旗下艺人。2008年以偶像组合2pm队长身份出道，2009年退队，2010年初与JYP解除合约，现为solo歌手、B-boy dancer、rapper、音乐制作人，songwriter, composer, model, choreographer。2010年3月因在youtube上传了自己改编歌词并且翻唱的B.O.B的《Nothing on you》，在不到24小时的时间内达到了200万的点击率，而一跃被国际认知，奠定了其在欧美的人气。2010年6月，朴宰范重返韩国，独立担当自己专辑的作词作曲制作人，成为了韩国歌坛新一代实力派偶像歌手。2013年创建音乐厂牌AOMG，2017年创建音乐厂牌H1GHER MUSIC', 'http://p2.music.126.net/KMeSNIoEP5JEo2T004VQUg==/109951166055278681.jpg');
INSERT INTO `singer` VALUES ('124573', '全仁权', '', 'http://p2.music.126.net/tHdWktb3Pvp26scnQJwqtg==/1365593480350729.jpg');
INSERT INTO `singer` VALUES ('124730', 'San E', '姓名：San E 本名：郑山（音译） 2010年 第七届韩国大众音乐奖 最优秀 Hip-Hop奖   　　JYP娱乐精心打造的第一个说唱歌手San E在即将出道前夕公开了搞笑照片吸引众目光。 ', 'http://p2.music.126.net/30Zd9PoVubW6JWjIFg0-TA==/18651015743360550.jpg');
INSERT INTO `singer` VALUES ('125175', 'Ailee', '李艺真（이예진 )，英文名Amy Lee，艺名Ailee（에일리），美籍韩裔歌手、演员。1989年5月30日出生于美国科罗拉多州丹佛，在新泽西州成长，毕业于苏格兰平原高中，曾就读佩斯大学，现休学中。经纪公司为YMC Entertainment，2012年2月9日以单曲《Heaven》正式出道。', 'http://p1.music.126.net/DwK6UMMBoyAJSjU8tKK6hw==/109951165095951320.jpg');
INSERT INTO `singer` VALUES ('125216', '白智英', '白智英，出生于1976年3月25日，擅长拉丁曲风，并以深情沙哑的嗓音而闻名，因参与演唱了许多热播韩剧的主题曲而被观众所熟知，被誉为韩国“OST女王”。白智英出道专辑的主打曲《SORROW》，是舞曲味道较浓的Pop、Drums、Bass曲风的混音音乐，也是旋律柔和的动听佳作。主打曲是表达利用因特网创造新世界的N世代的心声，是很适合边聊天边欣赏的歌曲。2001年底，白智英被前经理人兼男友公开两人上床的录像带后，所有演艺工作暂时被停止。2006年，经过长期的沉淀，白智英终于爆发并凭借《不再爱了》一举拿下Mnet KM 2006 最佳女歌手奖，事业走向了全新的开始。代表作：《不要忘记我》、《那个女人》、《像中枪一样》等。', 'http://p1.music.126.net/4tO5OizGSkk1FGonOQcjXQ==/109951164575365079.jpg');
INSERT INTO `singer` VALUES ('125394', '洪真英', '洪真英(홍진영，Hong Jin Young），1985年8月9日出生于光州广域市，韩国女歌手、演员。‘SWAN’组合成员。毕业于朝鲜大学。\n2006年，洪进英以电视剧《渊盖苏文》出道。2007年与韩智娜、许允美、金妍智三人成立‘SWAN’组合。2009年于《Mnet亚洲音乐大奖》中获得最佳Trot奖。2012年，荣获第12届大韩民国传统歌谣大赏优秀歌手赏。2013年，取得朝鲜大学贸易学博士学位。2014年3月11日开始录制《我们结婚了》，假想丈夫为演员南宫民。同年获得mbc演艺大赏Variety部门女子优秀奖，2015年，获得第29届金唱片最佳trot奖。', 'http://p2.music.126.net/yJRK3-QwRYUxlcbwg7A8sw==/109951163940812989.jpg');
INSERT INTO `singer` VALUES ('125686', '李宝蓝', '李宝蓝，韩国女歌手，女子组合SeeYa成员，2017年1月发行个人首张数字单曲专辑《엎질러진 물처럼》。', 'http://p1.music.126.net/nVnmpcYhZqbYIxmcckUNQg==/109951163079232018.jpg');
INSERT INTO `singer` VALUES ('125829', '朴春', '朴春（Bom Park），韩国女歌手，女子组合2NE1的成员之一。1984年3月24日出生于韩国首尔市，毕业于美国Lesley大学心理学系，所属YG Entertainment公司。出道前曾与李孝利，李准基一起出演了三星公司的广告，不久播出後，广告里跳舞的女孩立刻成了人们疯狂检索的对象。原本以为朴春会在这个大好时机以Dance歌手出道，随後开始一系列华丽的宣传。但出乎人们意料的是，不久後这个跳舞的女孩就消失在了人们的视线中，做回了她的普通练习生，3年後才重新以新的面貌出现。作为2NE1的主唱，朴春拥有一把极特别的好声音。', 'http://p2.music.126.net/uQ73MCkb1qAEBt6tbOJX7w==/109951163923110281.jpg');
INSERT INTO `singer` VALUES ('126011', '尹美莱', '尹美莱在现在的韩国是首屈一指的女RAPPER，绝对的大前辈，老公更是RAP圈内的大佬，两个人堪称韩国HIP POP 音乐的最高结合，可以毫不夸张地说是韩国的Beyonce和Jay-Z。', 'http://p2.music.126.net/mNwB377o44Rl92EcVZ_f1A==/3246857838689096.jpg');
INSERT INTO `singer` VALUES ('126019', '泰仁', '韩国女歌手泰仁，曾经参与了韩国喜剧明星组成的演唱团体namolla family的歌曲featuring演唱而被人们所认识。', 'http://p2.music.126.net/JyigFLW9CkTi8VyLcGOjfw==/18554258720386397.jpg');
INSERT INTO `singer` VALUES ('126066', '泫雅', '金泫雅，出生于1992年06月06日，以前为CUBE Entertainment旗下艺人，现为P NATION经纪公司旗下艺人。前女子组合4MINUTE成员之一。外表甜美可爱的她舞蹈性感、节奏强劲，被称为大韩民国最会跳舞的女艺人。泫雅原是Wonder Girls成员，2009年6月18日，以4minute组合成员身份正式复出，以首张单曲《HOT ISSUE》正式出道。2010年1月4日泫雅发表了她的个人单《Change》。2012客串了Psy的《江南style》，后来又演唱了女版《哥哥就是我的Style》。而泫雅个人第二张迷你专辑《MELTING》一经发出，主打歌《Ice Cream》在YouTube里的点击量不到三天就打破了韩国神曲“江南style”的记录，成为了韩国娱乐界在国际的代表人物之一。代表作品：《Change》《Bubble Pop》《Icecream》等。', 'http://p2.music.126.net/e9BlvbsNX7bk6m871ZejEw==/109951165672045631.jpg');
INSERT INTO `singer` VALUES ('126312', 'AOA', 'AOA（韩语：에이오에이；Ace of Angels的首字母缩写，直译“王牌天使”）是韩国FNC娱乐旗下第一支女子音乐组合和女子舞蹈团体，也是FNC第一支音乐与舞蹈共同活动的团体，最初由8名成员组成，现任成员包括智珉、酉奈、惠晶、雪炫和澯美，由智珉担任队长。成员们都有著一个特别的天使名字。而天使故事就是七位天使与连结地面之门的钥匙持有者，半天使Y发生的奇妙故事。七位天使经常透过水晶球看人类的世界，透过水晶球她们喜爱上了人类的音乐，忍不住好奇的Y，於是利用手上的钥匙，开启了地面之门，与七位天使来到地球。', 'http://p1.music.126.net/hO0sc9Q3p_QGM2UFvCv8RA==/109951164512160358.jpg');
INSERT INTO `singer` VALUES ('126339', 'BIGBANG', 'BIGBANG（빅뱅），韩国男子演唱组合，现以G-DRAGON（权志龙）、T.O.P（崔胜铉）、TAEYANG（东永裴）、DAESUNG（姜大声）四名成员的组成形式展开活动，组合原成员SEUNGRI（李胜贤）于2019年3月退出。2006年8月19日，组合以五人组形式在YG Family世界巡回演唱会首尔站上正式出道，并于同年12月22日发行首张正规专辑《BIGBANG VOL.1  SINCE 2007》。2007年5月开始进行全国巡回演唱会，并于7月推出第一张迷你专辑《Always》。2008年8月8日发行MINI专辑《STAND UP》，专辑中的歌曲《一天一天》在KTF连续六周蝉联第一名。2009年赴日本发展。2011年成为历史上第一个获得MTV欧洲音乐奖“Worldwide Act”的亚洲组合，并于2012年上半年登上美国格莱美官方网页，成为首个被格莱美介绍的韩国歌手。2012年2月发行迷你5辑《ALIVE》。2015年回归韩国歌坛；同年5月至8月发行数字专辑《MADE》，四张MINI专辑总销量超过340万。2016年8月20日在韩国首尔举办出道十周年纪念演唱会。2016年12月8日发行正规数字专辑《MADE FULL ALBUM》。', 'http://p1.music.126.net/dCeCerm-oUWn46Lq_yVKag==/109951165566707494.jpg');
INSERT INTO `singer` VALUES ('126345', 'Brave Girls', 'Brave Girls（朝鲜语：브레이브걸스）是韩国Brave娱乐在2011年推出的五人女子团体，最初由恩英、书雅、艺真、瑜真、慧兰组成，现任成员有玟莹、侑廷、恩智、裕那。2011年4月8日发行首张单曲《The Difference》，并于音乐银行正式出道。Brave Girls的官方歌迷名称为Fearless，意思是战斗中勇敢无畏。', 'http://p1.music.126.net/bqj2ocOo9TeXVbxwS0v51Q==/109951166096512548.jpg');
INSERT INTO `singer` VALUES ('126524', 'CNBLUE', 'CNBLUE(씨엔블루)，韩国FNC娱乐旗下的乐团组合，现由3名成员包括郑容和（队长）、姜敏赫和李正信组成。\n       \nCNBLUE是Code Name BLUE的简称，其中BLUE是Burning（李宗泫）+Lovely（姜敏赫）+Untouchable（李正信）+Emotional（郑容和）的合成词，寓意团员的特质都是不同。\n              \nCNBLUE官方爱好者名为BOICE，是CNBLUE的BLUE +VOICE的合成词，寓意歌迷就是CNBLUE的声音，另一意思是希望歌迷的声音永远与CNBLUE同在。没有官方应援色，官方应援物名为BLISH（有不同版本深浅不一的蓝色毛巾），是CNBLUE的BLUE +STYLISH的合成词，寓意歌迷都是闪闪发亮。', 'http://p1.music.126.net/s6pZXLgLu3nYO8HRTWtMYA==/109951165923697458.jpg');
INSERT INTO `singer` VALUES ('126600', 'Tiger JK', 'Tiger JK，本名：徐正权，是韩国最著名的HipHop歌手之一，前音乐组合Drunken Tiger成员。', 'http://p2.music.126.net/QcKbVSJ7EysOU128H60fvg==/3223768093595135.jpg');
INSERT INTO `singer` VALUES ('126721', 'EXID', 'EXID （이엑스아이디）是韩国AB娱乐（2014年更名为Gamgak娱乐）于2012年2月成立的五人女子音乐组合，初出道由LE、正花、 哈妮、有智（U ji）、多美（蕙妍）和海岭组成，官方歌迷名称为“LEGGO”。但出道后的两个月多美、有智和海岭退出组合，公司在8月加入惠璘和率智成为EXID的新成员。2014年6月27日，EXID转至Yedang娱乐公司(现更名为Banana Culture)旗下继续后续演艺活动。', 'http://p1.music.126.net/5EgjkLY-5nm09iwiTar3Qg==/109951163680276684.jpg');
INSERT INTO `singer` VALUES ('126783', 'FIESTAR', 'FIESTAR（韩语：피에스타）为韩国的6人女子团体，成员来自韩国和中国，每位成员都历经了至少四年的练习生生涯，成员为金珍熙（Jei）、曹璐（CaoLu）、金惠美（Hyemi）、林敏智（Linzy）、李艺智（Yezi）安敏知（cheska）【已退队】，经纪公司为LOEN娱乐。曾和IU等前辈一起组成Loen Tree，为公司发行夏日特别专辑《夏日故事》（Summer Story）。', 'http://p2.music.126.net/1Ew8kvsC-D-gVOG3zAkuJA==/109951163537754854.jpg');
INSERT INTO `singer` VALUES ('127249', 'MYNAME', 'MYNAME（韩文：마이네임）是R&B组合Fly to the Sky成员Fany培养的新人偶像组合，简称MN，是韩国男子演唱团体，由经纪公司H2media成立，成员包括建雨、仁秀、世容、俊圭与蔡晋，MYNAME于2011年10月末出道，而他们的首张单曲专辑《Message》于2011年10月28日在韩国发行，但这张单曲专辑并不是公开发售，只能透过参加签名会才能购买。2012年5月5日在日本的官网公布了他们的粉丝名称\"MYgirl\"，有着 “MYNAME + girl\" 的意思，就是想要各位粉丝都要成为他们的女孩的意思。', 'http://p1.music.126.net/bUgP5DkqvyHeQJ473Epf3A==/109951163537804409.jpg');
INSERT INTO `singer` VALUES ('127485', '七公主', '来自韩国的七公主，也被称为韩国历史上年龄最小的组合。第一批成员最大的9岁，最小的5岁、第五批成员最大的13岁，最小的9岁。2009年七公主正式解散，但是其中，优秀的成员李英幼已经归属BOF KOREA 公司，并且推出了专辑《lovely》。', 'http://p1.music.126.net/l_25T8HVr_MVyDsqz8V9KA==/5981343255608292.jpg');
INSERT INTO `singer` VALUES ('128176', '4MINUTE', '4MINUTE，韩国CUBE Entertainment公司旗下女子组合，由成员南智贤、许嘉允、全智允、金泫雅、权昭贤组成，风格以糖果朋克风为主。4MINUTE于2009年6月18日以首张单曲《HOT ISSUE》正式出道。2009年8月20日，4MINUTE公开了第一张韩语迷你专辑《FOR MUZIK》。2010年1月8日，成员金泫雅公开了个人solo《Change》，歌曲与龙俊亨（BEAST）合作。2010年5月19日，4MINUTE公开了第二张韩语迷你专辑《HIT YOUR HEART》。2011年4月5日，4MINUTE公开了首张韩语正规专辑《4MINUTES LEFT》。2012年12月15日同公司BEAST的张贤胜组成Trouble Maker的限定组合，赢得音乐市场的热潮。2012年4月9日第三张迷你专辑《VOLUME UP》公开发售，主打为《VOLUME UP》，MV于4月9日0时连同音源公开发布。2012年夏季，成员金泫雅参与了歌手PSY歌曲《江南Style》的音乐影片演出，而PSY也在8月时公布了金泫雅参与演唱的女版《哥哥你就是我的Style》。代表作品：	《Hot Issue》《Muzik》《HUH》《What\'s your name》等。', 'http://p2.music.126.net/S1JjqJRjPd5MyTfklkfwMQ==/3405187516346683.jpg');
INSERT INTO `singer` VALUES ('128245', '野菊花', '韩国独立乐队。由主唱全仁权，鼓手周灿权以及贝斯手崔圣园组成，所属社野菊花company，于1985年发行1辑[行进]出道，2014年获得第28届金唱片执行委员特别奖。', 'http://p2.music.126.net/lMsIty76YTpFhRD3Iie_tw==/580542139487857.jpg');
