INSERT INTO `singer` VALUES ('131186', 'Johann Strauss II', '约翰·巴普蒂斯特·施特劳斯（德语：Johann Baptist Strauss，1825年10月25日－1899年6月3日），因与其父同名，故通常称为约翰·施特劳斯二世或小约翰·施特劳斯，奥地利作曲家，以圆舞曲作品最为著名，如《蓝色多瑙河》。\n约翰·施特劳斯是著名音乐家老约翰·施特劳斯的儿子。他的两位弟弟约瑟夫·施特劳斯和爱德华·施特劳斯也是著名的音乐家。不过小约翰是整个家族中成就最大，名望最高的一位。他被誉为“圆舞曲之王”，为19世纪维也纳圆舞曲的流行作出了巨大的贡献。他“圆舞曲之王”的称号是由于他把华尔兹这种原本只属于农民的舞曲形式提升为了哈布斯堡宫廷中的一项高尚的娱乐形式。此外他的作品的艺术成就大大超越了他的前辈们（例如约瑟夫·兰纳和老约翰·施特劳斯），也更为人所熟知。不仅是圆舞曲，他的一些波尔卡、进行曲以及轻歌剧也相当著名。', 'http://p1.music.126.net/emEcbs6qhFFdU4GVO5dx-w==/109951163639000270.jpg');
