INSERT INTO `singer` VALUES ('156156', 'Jean-Bernard Pommier', '让-伯纳德·波米尔（Jean-Bernard Pommier，1944年8月17日－），法国钢琴家，指挥家。出生于法国贝济耶，1960年，他获得了柏林青年音乐家国际比赛的一等奖，并于次年获得了“法国艺术家协会奖”。他是Northern Sinfonia的艺术总监和Filarmonica di Torino乐团的首席指挥。', 'http://p2.music.126.net/WeqDsYgxwQA6S08vuzjaqQ==/774056185976054.jpg');
INSERT INTO `singer` VALUES ('159291', '桑田佳祐', '桑田佳祐，1956年2月26日出生，日本男歌手。出生在神奈川县的茅崎市，南方之星的主唱及吉他手。妻子为南方之星成员之一的原由子，目前育有2子。', 'http://p1.music.126.net/sweQTwHGyAo5Rb37gYz8Ig==/109951165914899132.jpg');
INSERT INTO `singer` VALUES ('159300', '米津玄師', '米津玄师（Yonezu Kenshi），1991年3月10日出生于日本德岛县德岛市，身高188cm，O型血，日本男歌手、词曲作者、编曲人、插画家、摄影师、舞者，所属REISSUE RECORDS事务所。\n2009年，米津玄师在VOCALOID上以“ハチ”的名义投稿、创作歌曲，2012年2月以本名“米津玄师”开始自作自唱歌曲。2013年5月发行首张单曲《Santa Maria》正式出道。2015年10月，发行第三张专辑《Bremen》，首次获得日本公信榜专辑冠军。2016年9月，发行双A面单曲《LOSER / NO.9》。2017年11月，发行第四张专辑《BOOTLEG》，获得日本公信榜专辑冠军，在第60届日本唱片大奖上获得最优秀专辑奖。2018年3月，发行单曲《Lemon》，配信销售超过300万，成为首位平成年代出生配信超过300万份的歌手。7月，米津玄师担任2020东京奥运会应援曲制作人。10月，发行双A面单曲《Flamingo/TEENAGE RIOT》，首次获得日本公信榜单曲冠军 。2019年12月，米津玄师创作的歌曲《红辣椒》，在第61届日本唱片大奖上获得唱片大奖。', 'http://p1.music.126.net/qTSIZ27qiFvRoKj-P30BiA==/109951165895951287.jpg');
INSERT INTO `singer` VALUES ('159692', '初音ミク', '初音未来（初音ミク/はつね ミク/Hatsune Miku），部分国人简称为“初音”，是日本Crypton Future Media株式会社企划·开发·贩售的，基于Yamaha的VOCALOID歌声合成引擎所制作的声音库软件及其拟人化形象，也衍生出动漫和游戏人物。是Crypton“角色主唱系列”（Character Vocal Series）的第一作，代号为CV01。', 'http://p2.music.126.net/-QWJunQEsgiYvEoF4VITgQ==/109951164605971338.jpg');
INSERT INTO `singer` VALUES ('160347', 'Zico', 'Zico(지코)，本名禹智皓(우지호、Woo Ji Ho)，出生于1992年09月14日，韩国歌手、Rapper、制作人。所属组合Block B队中职务为队长、Rapper、作曲、作词、备用主唱。', 'http://p2.music.126.net/uDSofJiC2ErBDE5u45W6AQ==/109951165102431660.jpg');
INSERT INTO `singer` VALUES ('160729', '中島美嘉', '中島 美嘉（なかしま みか、1983年2月19日 - ）,日本女歌手、女演员。也是继天后滨崎步后又一位新生代流行天后。中岛美嘉在2001年以主演日剧《新宿伤痕恋歌》及演唱单曲《STARS》同时出道。其美艳的外型及神秘感等个人风格，使中岛美嘉获得新时代完美歌姬、百变天后的美誉。2005年中岛美嘉主演电影《NANA》，成为该年日本国片年度票房冠军，更引起一股风潮。而随着电影在各国的发行，更让中岛的人气直线上升，声势遍及全亚洲。 中岛美嘉的歌曲以曲风多元著名，诸如摇滚、雷鬼、爵士等曲风，其中又以情歌最为著名；再加以她独特的唱腔及裸足演唱的习惯，在日本乐坛独树一格。', 'http://p2.music.126.net/rMj-tPTTGkmz2o6hMI7xVg==/109951165956020749.jpg');
INSERT INTO `singer` VALUES ('160947', 'IU', '李知恩 (IU)，1993年5月16日出生于韩国首尔特别市，韩国女歌手、演员、主持人。2008年以一首《迷儿》正式出道，历经一年的练习生生涯。2011年以一首《好日子》在韩国走红，随后于2011年末推出正规二辑《Last Fantasy》 PK记录74次，AK约90次。2013年IU发行正规三辑《MODERN TIMES》再次获得关注。2012年~2015年分别位列韩国福布斯名人榜第三、第八、第十和第十四位。2015年，发行迷你专辑《CHAT-SHIRE》，并被《Billboard》认可为韩国流行音乐百强榜的领跑者；同年，获得韩国大众文化艺术奖国务总理表彰奖；2017年4月，发行第四张正规专辑《Palette》。透过正规专辑《Palette》、翻唱专辑《花书签2》等音乐作品，于韩国盖洛普民调中心的“年度闪耀歌手”排行榜中登上冠军宝座,于甜瓜音乐奖凭正规专辑《Palette》获得年度专辑大赏, 于2018年举行的金唱片奖中获得音源大赏，以及Gaon Chart K-POP大奖中取得五个奖项。2018年10月10日发行出道10周年纪念数位单曲《BBI BBI》,2019年11月携第五张迷你专辑《Love Poem》回归歌坛，2020年2月1日，参与演唱tvN戏剧《爱的迫降》OST.5月6日,推出全新数位单曲《Eight》。2021年1月9日，IU在韩国第35届金唱片奖颁奖典礼中获颁最大殊荣的“音源大赏”\n李知恩还涉足主持以及表演领域，2011年1月，出演校园剧《dream high》；3月，成为SBS音乐节目《人气歌谣》的固定主持人。2013年，凭借周末剧《最佳李顺心》获得KBS演技大赏新人女演员奖 。2015年，主演KBS金土剧《制作人》。2016年，主演古装穿越《步步惊心：丽》。2018年3月，出演《我的大叔》,该剧在中国的影评网站豆瓣中拿到9.4分，居该站2018年度韩剧首位,获得了第6届APAN Star Awards “中篇电视剧——女子最优秀演技赏”,2019年4月，IU出演Netflix出品的韩国独立单元剧《Persona》,2019年7月13日，IU主演的《德鲁纳酒店》首播。2020年7月，参加tvN 综艺节目《带轮子的家》，2021年1月24日，IU发行正规5辑先行曲《Celebrity》，2021年3月25日，IU发行正规5辑《LILAC》', 'http://p1.music.126.net/LPhIplO6lWpDDs7kvRiAQA==/109951165832914019.jpg');
