INSERT INTO `singer` VALUES ('161330', 'Trouble Maker', 'Trouble Maker是由韩国CUBE娱乐公司于2011年推出的双人限定组合，由韩国歌手张贤胜与女子演唱组合4Minute成员金泫雅组成。\n2011年12月1日，Trouble Maker发行首张同名专辑《Trouble Maker》。2012年11月30日凭借同名歌曲《Trouble Maker》获得第14届Mnet亚洲音乐大奖最佳合作奖  ；同年12月14日获得Melon音乐奖潮流歌曲奖。\n2013年10月28日，Trouble Maker发行第二张迷你专辑《Chemistry》 ，主打曲为《没有明天》。', 'http://p2.music.126.net/vA1MR2xoGMI50zOiPwDkfQ==/1343603209199874.jpg');
INSERT INTO `singer` VALUES ('161545', '倉木麻衣', '仓木麻衣（1982年10月28日－），日本女歌手，生于日本千叶县船桥市，现居东京。现隶属NORTHERN MUSIC公司LOOP事务所（2007年－）。她的父亲是电影导演、实业家山前五十洋。祖父是诗人山前实治。2007年之前曾隶属GIZA Studio。2001年4月进入立命馆大学产业社会学院人文科学系就读，并于2005年3月毕业。截止2014年12月，她举办了超过300次的个人演唱会。CD总销量突破1600万枚（日本公信榜ORICON调查）。', 'http://p2.music.126.net/FDex21LtVXjdlB8Y90VCWQ==/109951166026826057.jpg');
