INSERT INTO `singer` VALUES ('231393', 'Pyotr Ilyich Tchaikovsky', '彼得·伊里奇·柴可夫斯基（俄语：Пётр Ильич Чайковский，转写：Pyotr Ilyich Tchaikovsky，1840年5月7日－1893年11月6日），俄国浪漫乐派作曲家，其作品有民族乐派特征，但仍以浪漫风格为基准。其风格直接和间接地影响了很多后来者。知名作品有六部交响曲（第六“悲怆”），四部协奏曲，芭蕾《天鹅湖》《胡桃夹子》《睡美人》，幻想序曲《罗密欧与朱丽叶》，1812序曲，管弦乐《意大利随想曲》《斯拉夫进行曲》，三首弦乐四重奏，钢琴三重奏，钢琴独奏《四季》，歌剧《叶甫盖尼·奥涅金》《黑桃皇后》。', 'http://p2.music.126.net/rIwm13Yv7Y086FVAAR0EDw==/109951165867911239.jpg');
