INSERT INTO `singer` VALUES ('408944', 'HKT', 'HKT组合来自越南的三名艺人titi、kiet、hung\"天团”爆红网络，被网友呼为“洗剪吹三人组”。2012年11月6日，HKT组合在新浪上开通微博，不到5个月就迎来了上百万粉丝，三位90后男生以视觉系的风格迅速攻陷网友审美，怪异的“视觉系家族”造型，狗血的MV剧情，山寨的音乐风格，掀起一股“农业重金属”风暴，被誉为“乡村重金属小清新”。', 'http://p2.music.126.net/LPUJZhKhDi-U7AFKUMScYg==/1378787596079396.jpg');
INSERT INTO `singer` VALUES ('438104', 'Mr Jay', '', 'http://p1.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
