INSERT INTO `singer` VALUES ('493780', '敏雅', '方敏雅（MINAH），1993年5月13日出生于韩国仁川广域市桂阳区，韩国歌手、演员，女子组合Girl\'s Day成员。\n2010年7月9日，方敏雅以女子组合Girl\'s Day出道，并推出单曲专辑《Girl\'s day party #1》。2013年3月14日，Girl\'s Day推出首张正规专辑《Expectation》；6月，方敏雅主演韩国电影《Holly》，并以此片获得第13届光州国际电影节的新人女主角奖；8月4日，担任SBS《人气歌谣》固定MC。2014年10月，方敏雅出演三星SNS电视剧《最佳的未来》；11月2日，担任《2014亚洲音乐节》MC之一。2015年3月1日，方敏雅发表首张个人迷你专辑《我也是女人》。', 'http://p1.music.126.net/wKrJsj0fVgnmzVa12Yff1w==/109951163055333129.jpg');
INSERT INTO `singer` VALUES ('516009', 'Ophélie Gaillard', '', 'http://p2.music.126.net/cioCVSMkGXECwaS4BJYmIQ==/109951163749435738.jpg');
INSERT INTO `singer` VALUES ('546614', 'Neru', 'Neru 是活跃在日本弹幕视频网站Niconico动画的VOCALOID原创音乐创作者。', 'http://p2.music.126.net/ixl2sL4oVGP3rQnKUuohYQ==/109951163533526002.jpg');
