INSERT INTO `singer` VALUES ('688674', 'Mat.Joe', '', 'http://p1.music.126.net/24xUXNOCYwPQkz75MDOQ0w==/3382097769330382.jpg');
INSERT INTO `singer` VALUES ('711683', '好妹妹', '好妹妹乐队 是由两个热情洋溢青春逼人的社会青年组成。“好妹妹乐队”的成员是两个清新干净的大男生：随性不羁的浪客秦昊和憨态可掬的张小厚。他们健康快乐积极向上，活泼进取热情开朗。他们英俊潇洒美丽婉约。是21世纪不可多得的大龄文艺青年。', 'http://p1.music.126.net/Lq1OiHWhO0vvzB0p_fRmgA==/109951163251486248.jpg');
INSERT INTO `singer` VALUES ('741062', 'Matt Sassari', null, 'http://p1.music.126.net/gs2lxCJda6tw1Sc4t9v8_w==/1426066590387038.jpg');
INSERT INTO `singer` VALUES ('742284', 'Dom Dolla', 'Dominic Matheson，以他的艺名Dom Dolla而闻名，他出生于1992年，是澳大利亚HOUSE音乐制作人。他一直在被提名两次ARIA奖为最佳舞曲版本 ; 于2017年与Torren Foot一起演唱《Be Randy》，并于2019年与歌曲《 Take It》一起演唱。', 'http://p2.music.126.net/q8NSjqQWLzFJRFoCT79orA==/109951164373408815.jpg');
INSERT INTO `singer` VALUES ('747030', 'Vicetone', '自2012年成立以来，荷兰DJ双人组Vicetone的所有作品提现了他们优秀的制作能力和无穷的想象力。音乐人/制作人Ruben den Boer和Victor Pool定居于Nashville，在他们的家庭工作室中，他们从零开始制作每首歌曲的，亲自完成每个细节，打造了一个充满情感的舞曲风格。迄今为止，他们的作品在所有平台上的播放量已达到10亿。多年来，Vicetone完美的旋律感和高超的制作技巧让他们享誉全球。他们也因自己对电音的独到了解而多次进入DJ mag的榜单\n2014年DJ Mag百大DJ，排名36。 \n2015年DJ Mag百大DJ，排名50。  \n2016年DJ Mag百大DJ，排名81。 \n2019年重新入围DJ Mag百大DJ，排名83。', 'http://p1.music.126.net/cQK0UiVmN_GaLh0xqXIhcA==/109951165852222406.jpg');
INSERT INTO `singer` VALUES ('761018', '李洪基', '李弘基（이홍기），1990年3月2日出生于韩国首尔，韩国歌手、演员，韩国摇滚乐队F.T.Island成员之一。李弘基童星出身，2002年拍摄儿童剧集《魔法儿童Masuri》 。2007年6月以F.T.Island主唱身份正式出道。', 'http://p2.music.126.net/qEA2iEbAyzKvkQZMpLMi6Q==/109951164353541468.jpg');
INSERT INTO `singer` VALUES ('762511', '3LAU', '美国拉斯维加斯DJ，制作人Justin David Blau生于1991年1月9日，以艺名3LAU为人熟知（读作Blau），以融合了electro house, dubstep, deep house, progressive house等诸多风格且旋律性极强的舞曲为乐迷所知。自2011年起，3LAU发行了三张Mixtape以及数张单曲，曾在纽约Electric Zoo以及拉斯维加斯的EDC音乐节上进行演出，随后在辗转了如Dim Mark, Revealed, Aramda 等多个知名电音厂牌后2016年3LAU签约了Blume厂牌，并在2018年2月推出了自己大获成功的处女专辑《Ultraviolet》。', 'http://p1.music.126.net/swUH6oVud_hNHPF3txn23g==/109951164744862166.jpg');
INSERT INTO `singer` VALUES ('768159', 'CL', '李彩麟(이채린 / Faith Lee)，艺名：CL，韩国女歌手，1991年2月26日出生于韩国首尔，著名女子组合2NE1的队长。她以出众的实力、个性鲜明的风格与优秀的语言能力闻名，而自幼就在国外成长的经历也令多元的文化在她的身上碰撞出了奇妙的火花。自出道以来，她领导2NE1打破韩国女子组合的传统风格，积聚了超高的人气，开创了韩国女子组合的新气象，是2NE1的灵魂人物。', 'http://p1.music.126.net/WAJw0uLuiAzhbP8XLlJNEQ==/109951165763020087.jpg');
INSERT INTO `singer` VALUES ('768193', 'DISH//', 'DISH//（ディッシュ）は、日本のダンスロックバンド。スターダストプロモーションに所属するタレントで構成されたアーティスト集団「EBiDAN」から結成された。', 'http://p1.music.126.net/dQwmERok4VyVwsX4YubOIw==/109951165690710346.jpg');
INSERT INTO `singer` VALUES ('774157', 'Bumkey', 'Bumkey，是SOLO歌手，制作人，组合 Troy 的队长，发行个人SOLO歌曲《疯狂恋爱》《BAD GIRL》。所属公司：Brand NewMusic。', 'http://p2.music.126.net/c2q8ovo4Vxx_BABl28f4Bg==/109951164434215540.jpg');
INSERT INTO `singer` VALUES ('777564', 'Vintage Culture', 'Lukas Ruiz，更令人熟悉的是他的艺名Vintage Culture，1993年7月7日出生，是一名巴西DJ和制作人。这位巴西艺术家在网上有超过15亿的流量，在他的社交媒体平台上聚集了800万的流量，目前在DJ Mag的2020年100名DJ投票中排名第30。', 'http://p2.music.126.net/ooQAH9ZGfkAh15YFxcuM8Q==/109951166161946694.jpg');
INSERT INTO `singer` VALUES ('780003', 'Martin Garrix', '马丁·盖瑞斯（Martin Garrix），原名马亭·杰拉德·嘉伟森（Martijn Gerard Garritsen），1996年5月14日生于荷兰阿姆斯特丹，荷兰DJ、音乐制作人，毕业于赫尔曼育学院。\n2012年，马丁·盖瑞斯签约荷兰斯宾尼唱片公司，并发行无人声电音单曲《Error 404》。2013年6月，发行浩室电音单曲《Animals》，该首歌曲进入了十几个国家的音乐榜单前十。2014年4月，发行首张迷你专辑《Gold Skies》。2015年10月，马丁·盖瑞斯获得MTV欧洲音乐奖“最佳电音艺人”奖项 。2016年10月被《DJ Mag》评选为百大DJ第一名，成为该杂志创办之后最年轻的百大DJ第一名。同年11月，再次获得MTV欧洲音乐奖“最佳电音艺人”奖项 。2017年10月，马丁·盖瑞斯蝉联百大DJ第一名。2018年2月，在平昌冬奥会闭幕式上进行表演。2018年10月，马丁·盖瑞斯第三次获得百大DJ第一名。2019年10月，被《DJ Mag》评选为百大DJ第二名；11月3日，获得MTV欧洲音乐奖最佳电子乐奖。2020年，他在化身Ytram上连续发布3首单曲，并获得百大DJ第三名。', 'http://p2.music.126.net/SmqNVtVJpe_Uf-UZY-WIOA==/109951165973089945.jpg');
INSERT INTO `singer` VALUES ('783124', 'BTS (防弹少年团)', 'BTS (防弹少年团)，是韩国BigHit Entertainment旗下2013年出道的男子演唱组合，由RM、Jin、SUGA、j-hope、Jimin、V、Jung Kook 7名成员组成。BTS (防弹少年团)的含意是\"具有承受像子弹一样的时代偏见和压力的音乐团体\"，2017年7月4日则加入了“不安于现状，朝着梦想不断成长的青春”的涵义，原先以“防弹少年团”为英文缩写的“BTS”（BangTan Sonyeon Dan），也增添了“Beyond The Scene”超越现状的意思。BTS (防弹少年团)的官方歌迷名称为“A.R.M.Y”（韩语：아미），这个名称是在2013年7月9日通过官方网站首度亮相，来自于英文“Adorable Representative M.C for Youth”的缩写，意指“值得人们景仰的青年代表”，由成员们阅读约1000个粉丝意见后亲自选出，官方应援物为炸弹造型的手灯“A.R.M.Y BOMB”。2013年6月12日，发行出道专辑《2 COOL 4 SKOOL》；6月13日，以Mnet《M! Countdown》为出道舞台。', 'http://p1.music.126.net/iuOHZKWUBFMA-qi_jKZX9g==/109951166161837643.jpg');
INSERT INTO `singer` VALUES ('789929', 'Martin Ikin', 'Dj-ing & Producing music since 1991, Martin Ikin previously known as: DJ Mayhem, Soul Purpose, Indigo, Migrant.. and loads more, has spent his life making & releasing records on many labels and under many aliases. Including, Repopulate Mars, Defected, Toolroom, Lost, Cr2, Nervous, OFF, Exploited, Get Physical, Zrecords, MOS, Sony, Island, Atlantic and many more As well as being a fully trained studio engineer and jazz pianist, Martin\'s remix credentials include names such as: Mariah Carey, Jamiroquai, Clean Bandit, Blonde, Joey Negro, MAW amongst others.', 'http://p2.music.126.net/L2ISooqEmkyLbvI-PBg2aQ==/5837307231945294.jpg');
INSERT INTO `singer` VALUES ('791534', '戴荃', '戴荃，新国风实践者，C-pop （Chinese pop ）独立音乐人，音乐唱作人、制作人，代表作《悟空》、《老神仙》、《渡人》、《喝汤》、《上海三月》、《嫦娥》、《同时》、《青山白云》、《过客归人》、《二郎》。', 'http://p1.music.126.net/J9nBr5oAZjTV0xYXirs5MQ==/109951164592113447.jpg');
INSERT INTO `singer` VALUES ('804174', 'Wolfgang Amadeus Mozart', '沃尔夫冈·阿马德乌斯·莫扎特（德语：Wolfgang Amadeus Mozart，1756年1月27日－1791年12月5日），出生于萨尔兹堡，逝世于维也纳，是欧洲最伟大的古典主义音乐作曲家之一，他也是一位共济会成员。35岁便英年早逝的莫扎特，留下的重要作品总括当时所有的音乐类型。根据当代的考证显示，在钢琴和小提琴相关的创作，他无疑是一个天分极高的艺术家，谱出的协奏曲、奏鸣曲、交响曲、小夜曲、嬉游曲等等成为后来古典音乐的主要形式，他同时也是歌剧的专家，成就至今仍能顺应时代的变迁而不朽。此外其作曲风格兼具旋律及艺术性，悦耳而活泼开朗，令其作品地位足与巴赫及贝多芬相提并论，亦让人感受到音乐由巴洛克时期转向古典主义时期的不同。', 'http://p1.music.126.net/OoacxY8P6mFUiH8M_8n-Zg==/8000046605925044.jpg');
INSERT INTO `singer` VALUES ('804355', 'ギガP', 'ギガP，VOCALOID著名P主(Producer)之一，经常使用镜音リン・レン(镜音双子)，Megpoid(GUMI)进行音乐创作，作品常常被贴上「神调教 」的标签。经常帮助唱见们后期处理，自己也有很多翻唱作品。\n', 'http://p2.music.126.net/BTpHh0GZjo-12xJVegAm-g==/109951165341206335.jpg');
INSERT INTO `singer` VALUES ('810011', 'Martynas', 'Martynas Levickis在8岁时开始在?iauliai音乐学院接受严格的手风琴教育，在立陶宛、美国、意大利、法国、荷兰、波兰、爱沙尼亚和秘鲁参加比赛并获奖。 2004年 Martynas 成为第一位获得立陶宛 ‘Queen Morta’ 奖的手风琴家。 他曾在立陶宛与几个室内音乐管弦乐队联袂表演, 在英国他曾参加BBC 音乐会、BBC交响乐团和伯明翰交响乐团的演出. 还曾在BBC的特别受欢迎的 ‘The One Show’节目中出现, 2009年闯进了‘Lithuania’s Got Talent’比赛的半决赛。\n2008年 Martynas 来到伦敦皇家音乐学院, 师从 Owen Murray教授。 Martynas 是立陶宛手风琴家协会的活跃分子。 今后的计划包括 Park Lane乐队在伦敦浦契尔厅2011年系列音乐会, 他的首场演出将是2010年10月在Barbican 中心。', 'http://p2.music.126.net/LbqNFuzGFHs2ys_1bJq0Dw==/5924168650893251.jpg');
INSERT INTO `singer` VALUES ('818678', '宣美', '李宣美（Lee Sun Mi），艺名宣美，1992年5月2日出生于韩国庆州青旦县、韩国女歌手，Wonder Girls组合成员。\n2007年2月10日，以演唱团体Wonder Girls出道，年末获得第17届首尔歌谣大赏新人奖，2007年度韩国最受欢迎歌手奖；2010年2月20日，因学业暂时退出Wonder Girls组合；\n2013年8月20日，以Solo歌曲《24小时也不够》回归乐坛；2014年2月17日，发行迷你专辑《Full Moon》；12月3日，获得2014Mnet亚洲音乐大奖最佳舞蹈表演奖。\n2015年8月3日，Wonder Girls以乐队形式回归，宣美归队担任贝斯手。', 'http://p1.music.126.net/bWN_4JsmKNZMavp9IFU8ow==/109951166254899748.jpg');
INSERT INTO `singer` VALUES ('824090', '祖堅正慶', '祖堅 正慶（そけん まさよし、1975年1月10日 - ）は、日本の作曲家、音響エンジニア。現スクウェア・エニックス所属サウンドエディター。', 'http://p1.music.126.net/lyHCEqh8qKgI1FXMfjI5Kg==/3223768094536604.jpg');
INSERT INTO `singer` VALUES ('828172', 'Neon Steve', '', 'http://p1.music.126.net/puEkSRFqoND17gdam3VX3w==/109951164626317591.jpg');
INSERT INTO `singer` VALUES ('830062', 'TAIBIAN', 'TAIBIAN，由韩国歌手Rapsta和King Clap组成的二人组合。2013年以单曲《Queen》出道并进行活动。代表作有《배영하는 물고기》，《Romantic Harmony》等。', 'http://p1.music.126.net/X5D36WlzyabQwPweWwHgVA==/3413983618275356.jpg');
INSERT INTO `singer` VALUES ('839303', 'Sam Binga', null, 'http://p1.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('840746', 'Ash', null, 'http://p1.music.126.net/f8MSbwID3-0T1JLDJA1SuQ==/528865109167212.jpg');
INSERT INTO `singer` VALUES ('847346', 'Glass Animals', 'Glass Animals是一支来自英伦牛津郡的四人另类摇滚乐队，被Wolf Tone相中，作为旗下第一支乐队被签下。乐队成员有主唱Dave Bayley、吉他/键盘Drew MacFarlane、贝斯/键盘Edmund Irwin-Singer和鼓手Joe Seaward。\nGA的音乐似乎充满着近乎神经质的端庄和诡异的典雅。他们的音乐聪明，而富有动机。或许因为主唱学习的是神经系统科学？自然声场与电子声并重下，依然裹附着动人的R&B节奏，绵延悠扬，十首曲目浑然一体，如一剂药方，让听者仿佛走不出那个“原始森林”的角落，只能兀自惊叹他们的才华。', 'http://p1.music.126.net/atlBBxGvPM61o9e9lGy6BQ==/109951166370757788.jpg');
INSERT INTO `singer` VALUES ('851555', 'Chris Lorenzo', 'Producer, remixer and DJ, Birmingham UK\'s Chris Lorenzo is widely acknowledged for pioneering his hometown\'s emergent and increasingly popular Jackin\' house come Bassline hybrid sound, which he terms simply \"House & Bass\".  ', 'http://p1.music.126.net/T-ANa2PSpP5TnG6DeSHsig==/109951164331073275.jpg');
INSERT INTO `singer` VALUES ('858026', 'Touliver', null, 'http://p2.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('869001', 'Gary', 'Gary，姜熙健（강희건），1978年2月24日出生在韩国首尔特别市松坡区蚕室洞。韩国歌手、主持人。是韩国男子组合Leessang的成员，毕业于龙仁大学警护学。', 'http://p1.music.126.net/kYycjzMTkHscq7g2AihMig==/7914284698005977.jpg');
INSERT INTO `singer` VALUES ('886043', 'N.Flying', 'N.Flying（朝鲜语：엔플라잉；日语：エヌフライング），是韩国FNC Entertainment公司旗下第三个男子流行摇滚乐团，最初由权光珍、李承协、车勋、金宰铉所组成，并由李承协担任队长。经成员变动后，现任成员包括李承协、车勋、金宰铉、柳会胜、徐东成。与CNBLUE相同，N.Flying于韩国正式出道前，以独立乐团方式在日本展开活动。 韩国时间2015年5月11日零时FNC Entertainment透过官方脸书宣布 N.Flying 将于5月20日推出首张迷你专辑《Awesome》（朝鲜语：기가막혀）正式出道，并公开团体概念照。', 'http://p1.music.126.net/Vb3-yZO5A663sPdDfFv3yA==/109951166065161971.jpg');
INSERT INTO `singer` VALUES ('893484', 'The Chainsmokers', 'The Chainsmokers，是来自美国纽约的DJ组合。由成员安德鲁·塔格特和亚历克斯·鲍尔组成，2014年因一曲#SELFIE而走红，2016年凭借单曲Don\'t Let Me Down与Closer获得商业成功。', 'http://p2.music.126.net/0yUqMkYTpPzrpwwaHkFHGQ==/109951166425641467.jpg');
INSERT INTO `singer` VALUES ('896042', 'Madnap', null, 'http://p1.music.126.net/RMVtnQwgtFJj4mYj-RA0VQ==/109951164815075183.jpg');
INSERT INTO `singer` VALUES ('896894', '贰佰', '贰佰，来自内蒙古阿拉善的民谣唱作人。从2011年于网络发表首支单曲《我在太原和谁一起假装悲伤》至今，贰佰的每一首歌都曾被争相分享、传唱，无数年轻人都是在朋友圈听到并爱上了《玫瑰》和《***青春》，又迅速将其分享给更多人。他准确地唱出了迷惘青春里的美好，无常生命里的感动，那些粗砺而温暖、嘶哑而淡然的歌，让青春的悸动雕刻于时光之碑，锈迹斑斑却刻骨铭心。作为中国知名民谣厂牌麻油叶的主要成员之一，贰佰亲历并推动了麻油叶的成长与壮大，伴随其从Livehouse一路走向北京工体馆。2016年正式签约摩登天空，2017年春推出无数乐迷早已为之翘首以盼的首张专辑《嘿，抬头！》。', 'http://p1.music.126.net/t7SKpjyhaaQOafssDbrcsw==/109951163201189928.jpg');
INSERT INTO `singer` VALUES ('896927', '莫西子诗', '有那么一些人，他们唱那些本就在骨头里生长的歌谣，哼那些血液里流淌的调调和故乡回旋的旋律，歌里有，山川、树林、云雾、牛羊、旷野、老人、孩子、山川、月亮和自然，就像一首迷幻山歌。\n莫西子诗，诺苏（彝族），四川大凉山人，被誉为彝族民谣创始人，制作人，先锋独立音乐人。代表作《不要怕（阿皆咯）》《要死就一定要死在你手里》2014年发行概念专辑《原野》，2016年单曲《越过群山》等。', 'http://p2.music.126.net/GoExyTvIbYyMN2rXNigsPQ==/109951163346312690.jpg');
INSERT INTO `singer` VALUES ('905037', 'High4', 'HIGH4，是韩国N.A.P Entertainment 推出的韩国男子团体组合，于4月8日与IU合作歌曲《除了春天爱情和樱花》出道。\n由崔甲源制作人推出的High4组合由两名Vocal和两名Rapper组成。HIGH4这个名字有成员四人一起达到演艺界的顶峰之意。', 'http://p1.music.126.net/aw1dhssFWAgJT26qDefirg==/18762066418191391.jpg');
INSERT INTO `singer` VALUES ('905156', 'Getsunova', 'Getsunova，泰国GMM Grammy旗下四人乐队，于2007年正式出道。成员包括Prakarn Raiva， Panoth Khunprasert， Natee Osathanugrah， Komkadeach Sangwatanaroj。2016年获得Mnet亚洲音乐大奖泰国地区最佳年度艺人。Getsunova的《多远才算近在咫尺》、《一个无人解答的问题》和泰剧荷尔蒙的片尾曲《差异》等歌曲受歌迷的喜爱。', 'http://p2.music.126.net/6jmUSiSsP3IEPsjbnkfwow==/109951164036747851.jpg');
INSERT INTO `singer` VALUES ('905208', 'Jimi Jules', null, 'http://p1.music.126.net/6y-UleORITEDbvrOLV0Q8A==/5639395138885805.jpg');
INSERT INTO `singer` VALUES ('908181', 'Jannabi', 'Jannabi(잔나비)，为韩国独立摇滚乐队，由崔政勋、金道亨、尹洁、张景俊四名成员组成。成员同为92年又都属猴、因此乐队名叫Jannabi （Jannabi 在韩语固有表达中意为猴子）。\n人气作曲家新沙洞老虎设立唱片公司Cashmere Record，培养的独立乐队Jannabi，有超过80场Busking街头公演的经验！2019年乐队以《致犹豫的恋人》一曲名声大噪\n', 'http://p2.music.126.net/OuzowUBPyN5KpWDxmhBRjQ==/109951164510026794.jpg');
INSERT INTO `singer` VALUES ('934035', 'Khatia Buniatishvili', null, 'http://p1.music.126.net/KmYpERvLNbwSfnQCtXsw5g==/109951163909207366.jpg');
INSERT INTO `singer` VALUES ('939029', 'CID', '', 'http://p2.music.126.net/-jyPTuzG3liNVLbR0t6YoA==/18632324045852786.jpg');
INSERT INTO `singer` VALUES ('961358', '不才', '独立音乐人 、歌手，代表作《化身孤岛的鲸》、《寻常歌》、《夜航星》 \n2020年担任制作人发布第一张个人专辑《山止川行》', 'http://p1.music.126.net/j-4dVsdH2Vg_vzpNbraPBA==/109951163551854183.jpg');
INSERT INTO `singer` VALUES ('963067', 'Lillo', '', 'http://p1.music.126.net/fS40ZzKkK5Cw7wsMhESxkA==/109951163462489561.jpg');
INSERT INTO `singer` VALUES ('963431', '陈致逸', '陈致逸，男，汉族，作曲家、音乐制作人。代表游戏配乐作品米哈游《原神》。', 'http://p2.music.126.net/74UZk4iXGOUHWbmAol1vAQ==/109951163100243732.jpg');
INSERT INTO `singer` VALUES ('964049', 'Heize', 'Heize，本名张多蕙，韩国CJ E&M旗下的女歌手，1991年8月9日出生，2014年1月17日通过单曲《再多徘徊一会》正式出道。2015年，参与韩国大型女饶舌歌手比赛《Unpretty Rap Star Vol.2》，从而得到大众关注 。', 'http://p1.music.126.net/q2cFD61opquSXS6bPLLn4w==/109951165098354503.jpg');
INSERT INTO `singer` VALUES ('964311', '阿良良木健', '不知名P主。曾写过「春风来」「CONNECT～心的连接～」「I LOVE U」等歌曲，点击都不高。曾出版过个人专辑「恋爱理论」，一度滞销。现在成为了一名天天在家玩switch的废宅。', 'http://p1.music.126.net/7_83DxMyy7Er2TULtYqA3A==/109951165133809077.jpg');
INSERT INTO `singer` VALUES ('973004', '程璧', '程璧，独立音乐人，词曲创作者。 2015华语金曲奖年度最佳国语女新人。\n2018华语金曲奖年度最佳民谣艺人。 嗓音\"优美沉静，清亮崭新\"，被称为\"离诗歌最近的声音\"。 北京大学日文系硕士毕业，曾工作于日本设计中心原研哉设计研究所。现居东京，独立从事艺术创作与写作。 她以一把古典吉他进行音乐创作，为诗歌谱曲，包括中国诗人北岛、西川、张枣，日本诗人谷川俊太郎、金子美铃，土耳其诗人塔朗吉，叙利亚诗人阿多尼斯等国际诗人作品。 目前已发表音乐专辑作品《晴日共剪窗》、《诗遇上歌》、《我想和你虚度时光》、《早生的铃虫》、《步履不停》、《然后，我拥抱你》等。 跨国文化的音乐元素，某些质朴情感的共通，体现\"朴实、含蓄、留白\"的生活审美。为中国民谣界带来一股回溯过往与正视简单生活的清风，以及些许童趣。 国际美学大师原研哉，对程璧音乐作品的评价广为流传：透过程璧的音乐，能够感受到现在中国年轻女性在追逐着什么。', 'http://p1.music.126.net/CmRQZ8MlVqgn88QJ3rGdgQ==/109951165118887058.jpg');
INSERT INTO `singer` VALUES ('975714', '叶洛洛', '古风歌手，福建泉州人，出生于1993年5月8日。代表作：《小了白了兔》、《有点饱》、《蜉蝣梦》等。', 'http://p1.music.126.net/mOah06tjMX1lD9Nkl56qPg==/109951163393596927.jpg');
INSERT INTO `singer` VALUES ('981141', '伦桑', '伦桑，平纱落雁原创音乐团队歌手。2014年12月发行第一张古风原创专辑《桑道伦回》。声线温柔清润，擅长中低音。古风原创歌曲《天地缓缓》《烟雨行舟》《十方天下》《山有木兮》等作品广受好评，并为倩女幽魂，剑网3，天下3，龙之谷等网络游戏演唱歌曲。翻唱作品风格多变，驾驭各种曲风，《人质》《红颜》《告白气球》等翻唱作品个人特色鲜明。', 'http://p1.music.126.net/uXzSEe2qo-yZXyZQ1-OA9A==/109951163552619098.jpg');
INSERT INTO `singer` VALUES ('996104', 'ひとしずく×やま△', 'ひとしずくPは2011年以降やま△とのユニット“ひとしずく×やま△”を中心に活動を展開。', 'http://p1.music.126.net/3VTs7hZhCKywbZKCVEo_vg==/6664139976217594.jpg');
INSERT INTO `singer` VALUES ('1007170', '陈粒', '陈粒，又名粒粒，1990年7月26日出生于贵州省贵阳市，中国内地民谣女歌手、独立音乐人、唱作人，前空想家乐队主唱，毕业于上海对外经贸大学。2012年，其所在乐队“空想家乐队”获得“Zippo炙热摇滚大赛”上海赛区冠军。2014年，随空想家乐队推出乐队首张EP专辑《万象》；同年，其演唱的歌曲《奇妙能力歌》入围“第四届阿比鹿音乐奖”年度民谣单曲。2015年，推出首张个人音乐专辑《如也》；同年，推出个人民谣单曲《远辰》。2016年1月，获得“第五届阿比鹿音乐奖”最受欢迎音乐人（民谣）；同年3月8日，化身“粒粒”并推出首支单曲《幻期颐》；同年7月26日，推出第二张个人音乐专辑《小梦大半》。2017年，担任芒果TV选秀娱乐节目《快乐男声》的音乐召唤师；同年，推出第三张个人音乐专辑《在蓬莱 in Blue Note Beijing》。2018年，推出第4张个人音乐专辑《玩》。2019年，担任优酷视频原创音乐人竞技成长秀节目《这！就是原创》的导师；3月25日，获得第26届东方风云榜音乐盛典年度原创音乐人奖。7月26日，发行专辑《洄游》；11月9日，在成都开启首场《洄游》巡演。', 'http://p2.music.126.net/3WhzK6ozFXUsNutDU566ZA==/6641050233030995.jpg');
INSERT INTO `singer` VALUES ('1011143', 'iKON', 'iKON(아이콘)，是韩国YG娱乐于2015年推出的男子组合，历经出道生存节目《WIN》和《MIX & MATCH》，最终由B.I（队长）、BOBBY（《Show Me The Money 3》冠军）、金振焕、宋允亨、具俊会、金东赫和郑粲右七人组成。 2015年9月15日出道时以《取向狙击》横扫韩国Melon等8大音乐排行榜，并囊括韩国五大颁奖典礼MMA、MAMA、首尔歌谣大赏、金唱片大赏和Gaon Chart K-POP大奖的新人赏，完成“新人赏大满贯”。2016年1月13日于日本出道后，亦获得最佳新人赏的殊荣。2018年1月25日发布的第二张正规专辑《Return》之主打歌《Love Scenario》除了横扫韩国Melon等7大音乐排行榜外，更连续位居实时榜单一位达41日，突破近十年来韩国乐坛史的最长纪录。同年2月9日更被美国《时代杂志》选为现时K-POP（韩国流行音乐）界中的6大团体之一。\n                 \n2019年6月12日，成员B.I因毒品事件而退出组合。组合现以6人体制继续活动。', 'http://p1.music.126.net/o0VHwTH1R2JIvya9U3tbEg==/109951165050893150.jpg');
INSERT INTO `singer` VALUES ('1015114', '任东', '时光带不走理想的歌...', 'http://p2.music.126.net/3__1AhrsQEM3mLcIhQXusA==/109951165778496201.jpg');
INSERT INTO `singer` VALUES ('1021160', '烟把儿', '微博：烟把儿乐队 QQ群：135896559 公众号：yanbaer666\n鲁西北Bigbang 德州五月天', 'http://p2.music.126.net/nQWt42m9i3JvakPXGDAF5g==/6660841442329618.jpg');
INSERT INTO `singer` VALUES ('1030001', '周深', '周深，1992年9月29日出生，贵州贵阳人，浙江卫视《中国好声音》第三季学员，所属那英团队。\n2014年，参加浙江卫视《中国好声音》第三季第二期，以一首齐豫的《欢颜》获得导师们的赞赏；9月1日在《中国好声音重返巅峰》节目，带着一首《美错》，赢得了陈晓东和王治平的充分的肯定；10月7日，参加《好声音总决赛》，凭借《贝加尔湖畔》获得“中国好声音”年度金曲。2015年春节大年初一北京卫视春晚献唱多语版《Let it go》支持北京申办冬奥会。2015年4月为电影《何以笙箫默》片头片尾配唱人声SOLO《You Are My Sunshine》。7月发行首张翻唱专辑《回味》并举办新专辑首唱会。8月发行个人全新单曲《玫瑰与小鹿》。', 'http://p1.music.126.net/ddFj3yFd0VifrxbenUL4kA==/109951165048013094.jpg');
INSERT INTO `singer` VALUES ('1032247', '赵钶', '赵钶（Key)，1992年2月1日出生于陕西省西安市，水瓶座，身高174，体重118斤，粉丝名称:颗粒，中国内地流行乐男歌手，毕业于西安音乐学院。\n从小学习音乐，在四岁的时候就参加合唱团，电子琴培训班，小时候的梦想就是上音乐学院，14岁那年被父母送到音乐学院正式学习音乐，18岁正式考入西安音乐学院，从小的音乐熏陶，造就了他出众的音乐修养，在歌曲改编，演唱方面，都有着自己独特的魅力。\n2010年，参加“第二届天声我才K歌争霸赛”，获全国总决赛亚军。2011年，参加深圳卫视“第八届中国音乐金钟奖流行音乐大赛”，获得西安赛区男子组八强。2014年，参加浙江卫视歌唱选秀节目《中国好声音第三季》的比赛，最终获得杨坤组16强；同年，推出首支个人单曲《廉价的爱》。2015年，推出首张个人EP专辑《赵钶》，同年，主演青春励志网络剧《音乐碉堡了》。2016年，凭借歌曲《再见我》获得“艾飞音乐奖”年度最受欢迎流行艺人奖的提名。', 'http://p1.music.126.net/lSUKuoI_ii_BYySVreRJrg==/109951162913432165.jpg');
INSERT INTO `singer` VALUES ('1038040', '赵紫骅', '赵紫骅，原名赵浴辰，1988年4月27日出生，中国大陆男歌手、音乐人，毕业于北京现代音乐学院。2013年，参加快乐男声，2014年12月参与中国正在听凭出众创作才能获得全国冠军 。赵紫骅对音乐创作有良好天赋，是一位风格完整素质均衡的优质歌手。他的代表作《可乐》被谢安琪、孙楠翻唱，《时间轴》被杨坤收录到《今夜二十岁》专辑中。\n2017年初签约太合音乐集团旗下厂牌太合麦田。\n2017年4月20日，发行单曲《时间轴》。\n2017年4月26日，在北京举办个人专场音乐会。\n2019年9月12日，发行单曲《月亮不回家》；12月24日发行单曲《你还好吗》\n2020年1月1日，发行单曲《一滴泪的时间》；8月24日发行单曲《短歌》；9月11日发行《因为你来过》；9月25日发行《理由》；11月20日发行《怪我更爱我自己》', 'http://p1.music.126.net/KTHZLI8H_x8uzLluRCfxlw==/109951165271148738.jpg');
INSERT INTO `singer` VALUES ('1039222', '梅粮新', '只是一个兴趣使然的音乐人罢了 \n微博/B站 @梅粮新\n后援群“313900287”\n合作联系 Merothy505@outlook.com', 'http://p2.music.126.net/K3UNTz8tsGLSOIivd6aP2w==/109951164969934574.jpg');
INSERT INTO `singer` VALUES ('1039314', '叶里', '叶里，独立音乐人，唱作人，嗓音独特，磁性且有辨识度，喜欢以“玩”的方式去做自己喜欢的音乐，其创作的歌曲曲风众多，大多都带有中国元素，将传统和新潮非常完美地融合在了一起。\n 主要经历：\n 2009年开始创作原创歌曲，2013年发布第一张个人同名纪念专辑《叶里》，2014年正式成为全职音乐人，先后陆续在成都和杭州举办个人专场歌会，并于2015年参加滚石原创歌手大赛，从海选到总决赛，最终凭借原创歌曲《落花不过身外客，流水从来是凉薄》和《不敢提及你的名字，怕扰了相思》荣获滚石原创歌手大赛“最佳作词奖”和虾米寻光计划“虾米寻光奖”。目前已创作发行三张原创音乐专辑，分别是《故事》（2014年）、《长歌名行不行》（2015年）、《天地》（2017年）和《我的意中人》（2018年）。主要作品：《无归》、《不敢提及你的名字，怕扰了相思》、《锦上》。\n\n联系方式：\n微博：@叶里_ \n公众微信：yeliliya', 'http://p1.music.126.net/WiZXE2MmrcoIjHoIj9sPMg==/109951163745499413.jpg');
INSERT INTO `singer` VALUES ('1039895', '谢春花', '谢春花，本名谢知非，毕业于浙江工业大学，音乐人。2014年，正式投入歌曲创作。2015年初，上线多首歌曲Demo，逐渐积累听众群。2016年6月发行首张个人创作专辑《算云烟》，同年举行“算云烟”全国巡演。2017年5月发行第二张个人创作专辑《知非》，并开启“知非”全国巡演。2017年12月30日于北京展览馆剧场成功举办“花开时”首场个人演唱会。', 'http://p1.music.126.net/mLirmp3X0sC7ayI9zyJ3Kw==/109951162843076938.jpg');
INSERT INTO `singer` VALUES ('1043105', 'Punch', 'Punch(펀치)，本名배진영，出生于1993年2月19日的韩国新人女歌手，曾参与多部热门韩剧OST演唱。', 'http://p1.music.126.net/S912K5EoEiGUE9p3lmM5YQ==/109951165792264807.jpg');
INSERT INTO `singer` VALUES ('1045123', 'Alan Walker', '艾兰·奥拉夫·沃克（Alan Olav Walker），1997年8月24日出生于英国英格兰北安普敦郡，挪威DJ、音乐制作人。\n2014年11月，在YouTube上推出个人电音作品《Fade》而出道。2015年12月，通过索尼音乐发行个人第一首正式单曲《Faded》，该首歌曲的MV在YouTube上的点击量突破了12亿。2016年6月，发行人声伴唱电音单曲《Sing Me To Sleep》 。同年11月6日，获得MTV欧洲音乐奖“最佳挪威艺人”奖[4]  。2017年2月22日，《Faded》入围第37届全英音乐奖“年度英国单曲”奖 。同年5月，发布首支由男声伴唱的电音作品《Tired》 。', 'http://p1.music.126.net/bx2BUByvazqs3g5QbAJq0Q==/109951166656423669.jpg');
INSERT INTO `singer` VALUES ('1047064', 'KBShinya', '视频网站知名UP主，网络歌手。', 'http://p2.music.126.net/34uF4vg0f4LuDmqgnOpksQ==/3251255906655620.jpg');
INSERT INTO `singer` VALUES ('1047088', '小魂', '小魂，国风歌手，5sing中国原创音乐基地认证音乐人、推荐歌手、热门音乐人；其嗓音极具辨识度，有“自带后期”之称。且风格多变，时而温柔多情，时而大气豪放，时而潇洒飘逸。代表作《风起兰陵》、《策权天下》、《主宰》、《龙战苍穹》、《战魂云隐》等', 'http://p1.music.126.net/8eZIJkhOt6I3vCBuTPaz3Q==/109951164366684991.jpg');
INSERT INTO `singer` VALUES ('1047237', '五音Jw', '五音Jw，独立原创音乐人，知名网络歌手。声音细腻且富有辨识度，可荡气回肠，亦可温润如晚风，在流行与古风之间切换自如。代表作《明月天涯》、《步戏》、《忆江南》、《相思门》等。2015年发行个人首张原创音乐专辑《聆音》。2017年发行全新原创音乐专辑《万人景仰》。', 'http://p2.music.126.net/iOOnnH5Irpe76VL83KpW-g==/109951163058968523.jpg');
INSERT INTO `singer` VALUES ('1047282', '泠鸢yousa', '歌姬+填词者，见习画师+pv师\n音乐主页：http://1462744.5sing.com/', 'http://p1.music.126.net/vl1zrnMv9EaiHcFmSIJ1Fg==/2946691214429184.jpg');
INSERT INTO `singer` VALUES ('1047389', '上上', '中国内地男歌手/原创音乐人，《声入人心2》成员，CCTV《渴望现场》冠军，代表作《青春大概》《天空之梦》等。', 'http://p2.music.126.net/bpV_J5dZsthFe1miB64V8A==/109951165954012138.jpg');
INSERT INTO `singer` VALUES ('1047400', 'Code Kunst', '코드 쿤스트(Code Kunst) 本名조성우，AOMG旗下歌手、制作人。', 'http://p2.music.126.net/-b2W7NBGH4Fi4Buf51JbYA==/109951163542960025.jpg');
INSERT INTO `singer` VALUES ('1048004', '林斜阳', '古风歌手。代表作墨宝《奇妙娘》、《素衣》、《炎夏令》、《好梦如旧》等', 'http://p2.music.126.net/-7sNNuRJFsFSGOrC4oJWFg==/7881299349031069.jpg');
INSERT INTO `singer` VALUES ('1049217', 'Hoang Thuy Linh', '黄垂玲（Hoang Thuy Linh）出生地越南，她是越南国立电影大学导演系一年级学生。在主演《金瑛的日记》（Vang Anh\'s Diaries）走红，深得高中生和大学生好评。 据传黄垂玲因为和在美国旧男友的性爱视频在网上传播，视频出现后，引起越南国内一片哗然，所以电视剧《金瑛的日记》被停。', 'http://p1.music.126.net/JVvcTVg3EOZXQkp3MuN7Mw==/7742760882927410.jpg');
INSERT INTO `singer` VALUES ('1050282', '房东的猫', '快乐的民谣小组合 ：）\n唱作二人组，由吉他手吴佩岭（少年佩）和主唱王心怡（红鼻子小黑）组成。出道四年，已发行三张创作专辑《房东的猫》《柔软》《这是你想要的生活吗》，斩获不少奖项，去年他们带着新作品开启了「生活」场馆巡演，也大受好评。 房东的猫的音乐初听感觉非常的干净与清澈，平静中带着治愈。随着时间的推移与作品的累积，可以看出她们在不断寻求更多的可能性的同时，却始终都具备着温暖的基调与感人的力量，这是非常难能可贵的。并且她们的音乐在台湾、香港乃至马来西亚等地也十分受欢迎，是近年来为数不多能在港台地区进行馆级演出，去参加海外国际音乐节的新生代创作型音乐人。\n若有相关问题请私信微博：@青柴工作室', 'http://p2.music.126.net/Ypy6DuNsM9dUDAi-daXjmg==/2540971374930594.jpg');
INSERT INTO `singer` VALUES ('1050518', 'ILLENIUM', '来自美国丹佛的制作人ILLENIUM是目前最成功的跨界电子音乐艺人之一，他的作品高居美国舞曲榜前几名、播放量多达40亿，同时他也成为了各大世界顶级音乐节主咖。\n继他的首张专辑《Ashes》之后，ILLENIUM凭借他2017年的专辑《Awake》在主流音乐领域占据了一席之地。其中包括他的经典作品Crawl Outta Love，Fractures还有和Gryffin，Daya一起合作的Feel Good，都取得了重大成功。《Awake》在12个国家的iTunes电子专辑榜都居于榜首，获得了1亿多的播放量。\n2019年ILLENIUM发行了他的第三张专辑《Ascend》，也是他在主流厂牌的首秀。作为2019年最重磅的电子音乐发行（10亿多播放量）之一，该专辑荣登Billboard的“最佳舞蹈/电子专辑”排行榜榜首，并在Billboard 200获得前20名。专辑包括他与The Chainsmokers，Lennon Stella合作的热门歌曲Takeaway，与Jon Bellion合作的Good Things Fall Apart，与Bahari 合作的Crashing，与X Ambassadors合作的In Your Arms和Take You Down（记录了他过去与吸毒的斗争）。\nILLENIUM被认为是最近十年Billboard最佳舞曲/电子音乐艺人之一，他通过现场演出把梦幻般的音乐带给观众，征服了Coachella, Lollpalooza, Bonnaroo以及EDC等大型音乐节的观众。2019年的Ascend巡演中，他组建的5人乐队，在各大世界级演出场馆都一票难求，如纽约麦迪逊广场花园，洛杉矶斯台普斯中心，以及丹佛Red Rocks剧场（连续三晚演出）等。', 'http://p2.music.126.net/J97CFG2Cs0-X9eFbc46aQA==/109951166200418247.jpg');
INSERT INTO `singer` VALUES ('1050701', '礒部花凜', '礒部 花凛（いそべ かりん、1994年5月26日 - ）は、日本の歌手、声優。奈良県出身。\n身長157cm。血液型はA型。EFFECT所属。大阪芸術大学舞台芸術学科ミュージカルコース2年生。', 'http://p1.music.126.net/dTJ9lod24ntSpCdN9hbvBQ==/7705377488194268.jpg');
INSERT INTO `singer` VALUES ('1053145', 'CLC', 'CLC（씨엘씨）是韩国Cube娱乐旗下的一队七人女子音乐组合，现有七位成员包括承姬、有真、丞延、Sorn、睿恩、Elkie(已退队)及恩彬。CLC 于2015年3月19日正式出道，原始成员包括承姬、有真、丞延、Sorn、睿恩。2016年起2月29日加入两位成员回归，分别是Elkie及恩彬。团名“CLC”为“CrystaL Clear”之缩写，期许成员们能像水晶一样永远保持在洁净、闪耀的模样，出道前曾被称作“Cube Girls”。于2015年3月19日正式出道。\n2021年2月3日，CUBE娱乐正式宣布庄锭欣退出CLC组合；11月16日，成员Sorn合约到期并退出组合。', 'http://p2.music.126.net/g60PnTDCY1-BVvY9cT2Cbg==/109951165276521241.jpg');
INSERT INTO `singer` VALUES ('1053279', 'あいみょん', '爱缪（あいみょん Aimyon，1995年3月6日－）是日本女性创作歌手、作曲家及作词家，出生于兵库县西宫市，所属经纪公司为ENS Entertainment。', 'http://p1.music.126.net/0RMoHPQmrFptHqGg3N2qcw==/109951166652784583.jpg');
INSERT INTO `singer` VALUES ('1054159', '任素汐', '任素汐，中国戏剧演员，出生于山东省莱州市，毕业于中央戏剧学院导演系导演专业。任素汐是2010年以来戏剧舞台上迅速崛起的一位实力派演员，表演收放自如、松弛自然、灵动不羁、极具爆发力。2011年台湾李国修导演的一部《三人行不行》让她被戏剧观众熟知。2012年又以“品质保障”导演周申、刘露的作品《驴得水》惊艳戏剧舞台。', 'http://p2.music.126.net/9B2ohcNgIHglGqhKnJS_rg==/1407374900136683.jpg');
INSERT INTO `singer` VALUES ('1055016', 'OH MY GIRL', 'OH MY GIRL 是韩国WM Entertainment于2015年4月20日推出的首个新人女子团体，由崔孝定（HyoJung）、金美贤（Mimi）、柳諟我（YooA）、玄胜熙（SeungHee）、金祉呼（Jiho）、裵洧彬（Binnie）、崔乂园（ARin）七人组成。', 'http://p2.music.126.net/XYof3TicH_TP2wElyhMDNQ==/109951165965632791.jpg');
INSERT INTO `singer` VALUES ('1056002', '三无MarBlue', '知名唱见，哔哩哔哩UP主，独立音乐人，声线多变。', 'http://p2.music.126.net/Q4Kkm_AGui94QPsLsGOkuw==/109951165036531800.jpg');
INSERT INTO `singer` VALUES ('1058162', 'Two Popetorn', 'Popetorn Soonthornyanakij（ภพธร สุนทรญาณกิจ），小名：Two（ตู่），出生于1980年12月25日，泰国男演员、男歌手、词曲作者，影视作品有《公众系列》、《雀之灵》等。', 'http://p1.music.126.net/wDNPKY0t_w7aGSWqa-O8gQ==/2892815092873964.jpg');
INSERT INTO `singer` VALUES ('1058228', '陈鸿宇', '感性与理性时常交融，收敛与放纵并行发生，我是陈鸿宇，很高兴认识你。\n--\n事务联络：c@zhongyueji.com', 'http://p2.music.126.net/HQXDPPEJyy-wEItLuho3ww==/109951164488639978.jpg');
INSERT INTO `singer` VALUES ('1060132', '柳爽', '国籍：中国\n出生地：新疆\n职业：音乐人\n代表作：《莫妮卡》《夏日回音》《漠河舞厅》《高米店南》', 'http://p2.music.126.net/8HNv_H6Qf0JdRt79nvlHfA==/109951166669433027.jpg');
INSERT INTO `singer` VALUES ('1063083', 'Deep Chills', '作为热带浩室中最著名的人物之一，位于米兰的Deep Chills去年凭借他的热门单曲“Run Free”开始风靡一时，在全球累积了超过6000万的视频观看次数，在许多国家和地区进入了排行榜，并在Shazam排行榜上排名第一。', 'http://p1.music.126.net/z44oBysdj4N38Rxlbx5TkQ==/18746673255070061.jpg');
INSERT INTO `singer` VALUES ('1064050', 'Official髭男dism', 'Official鬍子男dism，简称“胡子男”，2012年成军，2018年加入PONY CANYON正式出道。首支单曲<ノーダウト>(No Doubt)被选为日剧《行骗天下JP》主题曲。2019年，Official鬍子男dism又为该日剧同名电影演唱主题曲<Pretender>。歌曲接连34周在Oricon居榜首位，并成为当年最早突破2亿点击量的曲目。首张正规专辑<Traveler>于2019年10月9日发行，并一举拿下O榜周冠。2019年，他们登上了NHK第70届红白歌会，并在2020年初发行单曲<I LOVE...>，该单曲被选为TBS电视剧《将恋爱进行到底》主题曲。作为2020年度最受关注的J-POP音乐人之一，Official鬍子男dism前进的脚步将不会停止。', 'http://p2.music.126.net/ZboentRJYhE6SbZIhExylA==/109951165708932736.jpg');
INSERT INTO `singer` VALUES ('1071031', 'Jam', 'Jam，独立音乐人，音乐代表作品《不露声色》《差三岁》等，用心创作的她，希望音乐可以越来越好。', 'http://p1.music.126.net/YBvBifSVT1oRoL7Hs8-f8w==/109951163398529539.jpg');
INSERT INTO `singer` VALUES ('1078007', 'Monogem', 'Monogem 原名 Jen Hirsh，洛杉矶唱作人。2017年发行备受期待的 EP《100％》，同时推出 Remix 版本。单曲《Wild》MV 由 Coco Arquette（美剧《老友记》中 Monica 扮演者Courteney Cox 的女儿）主演，并获得 Good Morning America、E！、Daily Mail UK、Alternative Press、NYLON 和 Perez Hilton等各大国际媒体大力推荐。', 'http://p2.music.126.net/4negQF765TUHyCgcp3pxcg==/109951163950837367.jpg');
INSERT INTO `singer` VALUES ('1080132', 'SEVENTEEN', 'SEVENTEEN是韩国Pledis Entertainment公司于2015年5月26日推出的男子组合，团名“SEVENTEEN”代表13名成员+ 3个分队+ 1个团体= 17，其中3个分队分别为嘻哈队、表演队、主唱队。\n组合由崔胜哲（S.COUPS）、尹净汉（JEONGHAN）、洪知秀（JOSHUA）、文俊辉（JUN）、权顺荣（HOSHI）、全圆佑（WONWOO）、李知勋（WOOZI）、李硕珉（DK）、金珉奎（MINGYU）、徐明浩（THE8）、夫胜宽（SEUNGKWAN）、崔翰率（VERNON）、李灿（DINO）13名成员组成，其中有10位韩国成员，1位韩裔美籍成员(洛杉矶)1位美韩混血和2位中国成员。\n2015年5月29日，发布首张迷你专辑《17 CARA》并正式出道；9月10日，发布第二张迷你专辑《BOYS BE》。2016年1月14日，SEVENTEEN获得第25届首尔歌谣大赏新人奖；1月21日，SEVENTEEN获得第30届韩国金唱片金唱片新人赏奖。', 'http://p2.music.126.net/nWNzhdAxuHu1vOvaEh8HeQ==/109951166108106942.jpg');
INSERT INTO `singer` VALUES ('1081889', 'Why', '韩国男歌手。', 'http://p1.music.126.net/zMYZQT7mkMMj4h_4xHOWxQ==/109951163464405434.jpg');
