INSERT INTO `singer` VALUES ('1084238', 'Lightscape', 'Lightscape来自加拿大的卡尔加里(Calgary,Canada)，音乐风格是Chillstep，在soundcloud上的简介是：\n“Every earthly stream runs dry But your love is a waterfall that fills me”', 'http://p2.music.126.net/Ot5wmXT-V-w4SUTmkCm12A==/7998947092614102.jpg');
INSERT INTO `singer` VALUES ('1085116', '张希', '这是华语乐坛一个全新的声音，今天之前，你也许在很多歌手的幕后制作名单当中不经意的看到过他的名字——张希，也许在一些民谣类歌手的演唱会上见到过他安静平和的面孔，可你不曾对他有过更多的关注，也不会想到，今天，作为一名唱作音乐人出现的他，会有着怎样一种与人分享自己音乐的快乐和幸福，而你，在听到他第一个音符的那一刻起，又会怎样不可避免的被他声音中那份特有的温暖和忧伤所命中。\n作为有着十年幕后经验的一名音乐人，张希在音乐圈内可谓少有的全面：除了创作、担任制作以外，他还是编曲高手，先后为赵薇、曹方、袁泉、水木年华、满江、王啸坤、曾轶可等歌手作品编曲，而耳熟能详的汪峰、老狼等人共同演绎的《藤》、《非诚勿扰》主题曲《向前一步》均出自他手；而他的另一个身份——吉他手，也让你在周笔畅、张靓颖、袁泉、曹方等人的唱片或演唱会上感受他精湛琴艺的魅力。', 'http://p1.music.126.net/t3-xTp7hFjxcRhOEcl436A==/1394180754062176.jpg');
INSERT INTO `singer` VALUES ('1087651', 'とあ', 'とあとは、VOCALOIDを用いた楽曲を投稿している楽曲製作者の1人である。\n\n2013年2月20日、初音ミクオリジナル曲「*キセキ*」をニコニコ動画に投稿し、ボカロPデビューを果たす。\n使用VOCALOIDは初音ミク・GUMI。TwitterによるとIA・MAYU・杏音鳥音も所持している模様。\n\n2014年6月12日に投稿した14作目「ツギハギスタッカート 百アイコン」が大ヒットし、自身初のVOCALOID殿堂入り楽曲となる。', 'http://p2.music.126.net/6sHOMcQ2VH4pOvS1aoIodQ==/109951165547322405.jpg');
