INSERT INTO `singer` VALUES ('1115046', 'Tiên Tiên', 'Tiên Tiên本名Huỳnh Nữ Thủy Tiên(黄女水仙)，越南女歌手、作曲家，1991年1月23\n日出生于越南林同省。代表作品有《Em Không Thể》《Đi Về Đâu》《Say You Do》等。', 'http://p2.music.126.net/rGr2N5RZ-6A47vDeG1QTtQ==/109951165668498208.jpg');
INSERT INTO `singer` VALUES ('1115075', '西瓜JUN', '西瓜JUN，唱作人，独立音乐人。原创代表作：《狂野想乡》《忘记》《长生诀》', 'http://p1.music.126.net/M-_RXaKA5bgvQ9CfGeT4bQ==/109951163009254045.jpg');
INSERT INTO `singer` VALUES ('1115185', 'Lulleaux', 'Lulleaux 准备在旋律电子音乐的宝座上安定下来。刚刚从法学院毕业，他一直致力于混音和原创作品，以他清新的音乐之声震撼所有人。在过去的 3 年里，Lulleaux 在热带/深海波中建立了一个稳定的名字，但在 2017 年，我们将听到来自他实验室的更广泛的声音和风格。他于 2017 年 1 月以出色的 LNY TNZ 混音“Burn It Down”（Big & Dirty Rec.）开启了这一新的音乐方向，随后于 2 月在 EPIC 阿姆斯特丹唱片公司（Martin Garrix，Hardwell a.o.）上发行。请继续关注这位荷兰天才的更多新鲜声音。\n\nLulleaux 在他还是个孩子的时候就第一次展示了他的音乐潜力，学习弹奏钢琴和键盘。从那时起，年轻人的生活发生了变化，音乐就在那里。永远。\n\n2013 年，他发现了制作软件和转盘。他的混音带名为 Radieaux，在很短的时间内变得非常流行。 2014 年 6 月，Lulleaux 对 Anna Graceman 的“Words”进行了混音，该作品在 SoundCloud 上获得了 160 万播放量并被 Kygo 收录。\n\n在 Kygo、Sam Feldt、Bakermat 和旋律世界中更多 DJ 的支持下，Lulleaux 很快表明他知道如何提供强大的盗版和混音带，这使他在网上广受欢迎。他的 DJ 演出也很受欢迎，在音乐节和俱乐部演出，他知道如何使用他的唱机带领观众进行一场梦幻之旅。\n\n他已经建立了令人印象深刻的追随者。他出演了 Sam Feldt 的“Been a While EP”（Spinnin Records），为 Benny Benassi（Ultra Records）进行了混音，现在有多个原作准备发行。在他与 FDVM 合作制作名为“Up To You”的 Dirty Soul 之后，Sony Music 发行了“Never Let You Down”，Dirty Soul Records 推出了强力民谣“Fade Into The Sun”，这是他展示他能够创作的广泛音乐的方式生产。', 'http://p2.music.126.net/sA33daGGyd2N0J0ph5lbEw==/109951163038159947.jpg');
