INSERT INTO `singer` VALUES ('12096061', '金请夏', '金请夏，1996年2月9日出生于韩国首尔，韩国女歌手，女子演唱组合I.O.I成员。\n2015年12月17日，参与演唱《PRODUCE 101》主题曲《PICK ME》。2016年4月1日，以40多万票在《PRODUCE 101》获得第4名，并成为限定组合I.O.I成员；5月4日，随组合发布首张迷你专辑《Chrysalis》；7月，参加舞蹈比赛节目《Hit The Stage》；8月9日，随组合发行单曲《Whatta Man (Good man)》，首批发行的3万张专辑在短时间内售罄。', 'http://p2.music.126.net/C2FY6XGVUYCPQT_MWzeDwA==/109951165745491254.jpg');
INSERT INTO `singer` VALUES ('12108460', 'Choco And Vanilla', 'Choco And Vanilla，韩国女歌手，独立音乐人，2016年6月13日发表首张单曲专辑《This Ain`t A Love Song》。', 'http://p2.music.126.net/SIBgbB2gDsycjbPRLudjJw==/109951163095246336.jpg');
INSERT INTO `singer` VALUES ('12121101', 'J. Lisk', '大家好，我是J Lisk。我来自加利福尼亚。我自己学中文，但我仍然不太流利。 我非常喜欢音乐，健身以及学习语言和文化+旅游。我去过中国，并参观了北京，成都和香港。 希望我能尽快回来。加油 J. Lisk官方网易帐号 艺人 工作事宜 演出请联系: officialjlisk@gmail.com INS: jliskmusic 微博: JLisk音乐', 'http://p2.music.126.net/P9gUAsMvIvOe4b2cIBN1hA==/109951166034763987.jpg');
INSERT INTO `singer` VALUES ('12121368', 'DPR LIVE', '横空出世的 DPR LIVE. 朴宰范、loco、crush、Dean等 众多代表韩国嘻哈的热门艺人参与他的出道专辑Coming to You Live，因此被称之为艺人认可的艺人.', 'http://p1.music.126.net/LQ3NTbrOnQk9QUSaIzqmhA==/109951166191933557.jpg');
INSERT INTO `singer` VALUES ('12128924', '陈涛', '既然轻松看出\n你的话题极少\n何必故作遍造一套\n再去逗你乐趣\n兴奋到极点\n眼泪会流出来\n一个人会心痛\n可无悔死心不改', 'http://p1.music.126.net/BGlOMYs3JxEpYdguBf50og==/109951165614642852.jpg');
INSERT INTO `singer` VALUES ('12138269', '毛不易', '毛不易，原名王维家，1994年10月1日出生于黑龙江省齐齐哈尔市泰来县，中国内地流行乐男歌手，毕业于杭州师范大学护理专业。2017年，参加选秀娱乐节目《明日之子》的比赛，获得全国总决赛冠军，从而正式进入演艺圈；9月1日，推出首张个人音乐专辑《巨星不易工作室 No.1》；11月11日，推出个人原创单曲《项羽虞姬》。', 'http://p1.music.126.net/W5LXS0-I-P9Wk6lQpS6HGA==/109951165787072463.jpg');
INSERT INTO `singer` VALUES ('12155133', 'EXO-CBX', 'EXO-CBX是SM娱乐旗下韩国男子音乐组合EXO在2016年组成的子团体，组合名称是由三位成员Xiumin、伯贤Baekhyun和Chen的英文名开头字母组成，并于10月31日推出首张迷你专辑《Hey Mama!》。2017年5月24日，EXO-CBX于日本出道并发行第一张日语迷你专辑《GIRLS》，9月22日，EXO-CBX为日剧《最后的生命：即使你明天消失》演唱OST《Cry》。2018年1月，EXO-CBX公布他们将展开首次日本竞技场巡演《Magical Circus》。', 'http://p1.music.126.net/G7c6MtYNZxbbJzOhtoEc6g==/109951165770594931.jpg');
INSERT INTO `singer` VALUES ('12157176', 'MOY', '如果一颗星代表一份快乐，那我就送你一条银河。', 'http://p1.music.126.net/q7HGCyHz-yNH0SbO5xUk6Q==/109951162804860399.jpg');
INSERT INTO `singer` VALUES ('12170236', 'MOMOLAND', 'MOMOLAND（朝鲜语：모모랜드），是MLD娱乐（前称Dublekick Company）于2016年透过与Mnet合作的练习生竞争节目《SURVIVAL MOMOLAND를 찾아서》选出的女子演唱团体，由10位少女在节目中挑战不同任务，争取出道机会，最终选出 慧彬、Nancy、妍雨、娜允、娥仁、珠园、JANE 七名成员。后来再加入两名成员 泰河、Daisy。\n2017年3月28日，加入在《SURVIVAL MOMOLAND를 찾아서》落选，JYP娱乐练习生出身的Daisy。\n2017年4月10日，加入PRODUCE 101、STARSHIP娱乐练习生、宇宙少女预备成员出身的泰河（JYJ成员金俊秀的堂妹）。\n2019年11月30日，官方宣布妍雨和泰河退出组合。Daisy目前则和公司还处于协商中，因此MOMOLAND将以6人体制活动。', 'http://p1.music.126.net/XLpixDwmjGRjEDd8Jakjjw==/109951165054872650.jpg');
INSERT INTO `singer` VALUES ('12174110', '崔开潮', '崔开潮，1995年11月1日生于湖北省。\n独立音乐人，毕业于西南科技大学。\n\n微博：@崔开潮', 'http://p2.music.126.net/uFRndbLC8hwCZ2gC_QfVHw==/109951166191570543.jpg');
INSERT INTO `singer` VALUES ('12174521', '音阙诗听', '微博：@音阙诗听 合作：hz@interestingcn.com\n音阙诗听音乐社团，成立于2016年11月1日，由殇小谨与李俊羽发起组织，围绕中国特色音乐实验室，塑造全新的互联网音乐实验团体。', 'http://p2.music.126.net/9AxOvJQqBkMY0pHC9VbPCw==/109951162809089968.jpg');
INSERT INTO `singer` VALUES ('12175308', 'はるまきごはん', '春卷饭（はるまきごはん）\n从作词、作曲、编曲到插画、视频、动画制作，所有创作均由1人完成，同时对作品质量也有着极高的要求。虽然名字颇具pop感，但一直以来作品中展现的多是伤感且情感充沛的世界。\nVOCALOID和自身的演唱，用两种方式演绎作品，演唱会借助原创动画打造戏剧化的效果，收获了极高的评价。同时也为众多知名艺人提供乐曲，2020年还为家乡札幌举办的“SNOW MIKU 2020”创作了官方主题曲。', 'http://p1.music.126.net/CjLpDXZSwImjOr8E3UbJrw==/109951166522070028.jpg');
INSERT INTO `singer` VALUES ('12183312', '晴小瑶', '世界以痛吻我，我报世界以歌。\n非专业，啥歌都能唱一点吧，就图个自己开心，如果能够娱乐大众就更好了，佛系。 微博名：晴小瑶丶', 'http://p1.music.126.net/GeszmayWk3muxMOMhXV4nQ==/109951165730318996.jpg');
INSERT INTO `singer` VALUES ('12205361', '刘莱斯', '刘莱斯，唱作人，企图用我的音乐温暖你你，谢谢你听我唱歌\n工作联系：15996312964 李老师（微信同）', 'http://p1.music.126.net/XvieLkc-P_fFwqPw3G7Jsg==/109951165604529419.jpg');
