INSERT INTO `singer` VALUES ('12218147', 'MIN', 'MIN本名Nguyễn Minh Hằng(阮明姮)，越南女歌手、舞者，1988年12月7日出生于越南河内。代表作品有《Ghen》《Vì Yêu Cứ Đâm Đầu》《Em Mới Là Người Yêu Anh》等。', 'http://p2.music.126.net/bn8unRdwyiRsOYOZtWAvSA==/109951165668492037.jpg');
INSERT INTO `singer` VALUES ('12226927', '土星皇家交响乐团', '该乐团成立于2016年10月6号。每一个人都来自五湖四海，我们不但演奏一些经典的作品，同时也会自己创作新的音乐。', 'http://p1.music.126.net/Q0xxESEr9e1ylRW-tyc4XQ==/109951163050420223.jpg');
INSERT INTO `singer` VALUES ('12227377', 'Kevinz', '业余写歌，目前主要创作Vocaloid音乐，仍在修炼过程中。B站id是Kevinz__，欢迎常来玩。\n所有词曲编皆由我完成的音乐作品（其他人担任策划的商业稿件情况除外），全部开放非商业使用授权（包括但不限于翻唱/翻调/翻填词/Remix），没有必要来问我啦。具体信息和伴奏下载地址请参考我的B站PC端个人主页公告。\n感谢各位的喜欢！', 'http://p2.music.126.net/x6m9ni1sGoOAePnYzxsjHw==/109951164654988441.jpg');
INSERT INTO `singer` VALUES ('12262562', 'DREAMCATCHER', 'Dreamcatcher（韩语：드림캐쳐），是Happy Face娱乐在2017年1月13日推出的七人女子团体，以首张单曲专辑《恶梦》主打歌《Chase Me》正式出道。其前身为 2014年9月18日出道的五人女子团体 MINX（韩语：밍스），成员有祉攸、秀雅、始娟、裕贤、多美。后于2017年加入2位新成员：韩东和佳泫，并以 Dreamcatcher 的名义重新出道。MINX 时期的粉丝名称为“VitaMINX”。\nDreamcatcher的官方粉丝名称为“인썸니아(InSomnia)”。 In是英文在...之中的意思，而Somnia是拉丁语梦中的意思，意谓著在梦里面Dreamcatcher跟粉丝们见面的幸福的时光，永远在一起。', 'http://p1.music.126.net/9PCx7paMZUu_ED7H72w6Xg==/109951166230386117.jpg');
INSERT INTO `singer` VALUES ('12263373', 'ナユタン星人', 'ナユタン星人とは、VOCALOID楽曲を公開している宇宙人のボカロPである。', 'http://p2.music.126.net/iDGS0pmsr29KzVBES9E2gQ==/109951164751226227.jpg');
