INSERT INTO `singer` VALUES ('12322107', 'THE TOYS', 'THE TOYS (เดอะทอยส์)，大名：ธันวา บุญสูงเนิน (Thanwa Boonsungnern)，小名：Toy (ทอย)，出生于1995年12月1日，泰国男歌手、词曲作者、音乐制作人，代表作品《去年冬天 (หน้าหนาวที่แล้ว)》《雨季之前 (ก่อนฤดูฝน)》《Lalaloy (ลาลาลอย)》，目前所属What The Duck唱片公司。', 'http://p2.music.126.net/BZbEQk3GWui4W6fpsAvRTQ==/109951166422415709.jpg');
INSERT INTO `singer` VALUES ('12323255', '須田景凪', '须田景凪（すだ けいな、1月20日 - ）是日本的音乐创作人、作词家、作曲家。使用VOCALOID P的活动名义是バルーン(balloon)。所属事务所是A-Sketch。日本华纳唱片厂牌unBORDE所属。', 'http://p1.music.126.net/o3kdbf8O_jSyNH_NYsbR3g==/109951165407080960.jpg');
INSERT INTO `singer` VALUES ('12323265', '神山羊', '神山 羊（かみやま よう、Yoh Kamiyama、1月9日 - ）是日本创作歌手。作词家、作曲家、编曲家。唱片公司是Sony Music Assiociated Records。\n\n\n\n概要\n\n初音ミクやflowerを用いたボカロオリジナル曲を投稿している\n\n動画、曲、詩をすべて氏が行うことが多く、動画内の写真を撮ったり、イラストを自身で描くこともある。\n\n初投稿は【初音ミク】退紅トレイン【オリジナル】この曲はVOCALOID処女作。\n\n于2018年11月3日宣布今后除了vocaloid仍使用有機酸的名义之外，将使用“神山 羊”名义进行活动。', 'http://p2.music.126.net/RUzcv-RgASavX0NnvvyO4g==/109951166592526833.jpg');
