INSERT INTO `singer` VALUES ('12514278', '那吾克热-NW', '那吾克热·玉素甫江（那吾克热-NW），中国内地流行说唱男歌手，毕业于北京第二外国语学院。\n2014年12月，推出首张个人音乐专辑《征途》（《MUSAPE》），从而正式进入演艺圈。2015年，参加CCTV-3原创音乐真人秀节目《中国好歌曲第二季》，最终获得刘欢组5强；同年，推出个人原创单曲《疯人院》。2016年，推出首张个人EP专辑《Hi 那吾》。2017年，出演了音乐剧《阿尔兹记忆的爱情》；同年，推出个人硬核说唱EP专辑《空袭》。2018年，参加爱奇艺音乐选秀节目《中国新说唱》，最终获得总决赛亚军；12月18日，获得中国时尚权力榜年度先锋说唱歌手奖。2019年5月11日，获得音乐先锋榜三十一载荣耀盛典最佳说唱歌手奖。', 'http://p1.music.126.net/MET9PrjxHdzl_1vdtRW0HA==/109951163755419545.jpg');
