INSERT INTO `singer` VALUES ('12531080', 'R!N/Gemie', 'R!N/Gemie,1994年6月8日生日，出生于爱媛县松山市。日本女性歌手。\n', 'http://p1.music.126.net/57YtLIar-Sy4YNT5Uh1Myg==/109951163124213955.jpg');
INSERT INTO `singer` VALUES ('12541250', 'Arthur Rubinstein', '阿图尔·鲁宾斯坦（波兰语：Artur Rubinstein，英语：Arthur Rubinstein，1887年1月28日－1982年12月20日），美籍波兰裔犹太人，著名钢琴演奏家，是20世纪最杰出、也是“艺术生命”最长的钢琴家之一。鲁宾斯坦被称为“最正宗的肖邦”，他一生不断地录制肖邦的作品，使自己的气质与肖邦的气质真正合而为一。他的演奏有温暖亲切的抒情、敏锐的分句加上丰富的音色与浓郁的诗意的特色。除肖邦之外，他演奏的贝多芬、勃拉姆斯和柴科夫斯基都注重于抒情性，有自己的特色。鲁宾斯坦不仅是杰出的钢琴家，也是杰出的室内乐大师，他与海菲茨、富尔曼及后来的皮亚蒂戈尔斯基组成的三重奏被称为“百万美元三重奏”，是二十世纪最伟大的室内乐团之一。他还与瓜纳里四重奏团成员合作组成钢琴四重奏、五重奏，录制了大量优秀唱片。', 'http://p2.music.126.net/iaqhBp0XUF_YSpoDK89NOw==/109951163250149252.jpg');
