INSERT INTO `singer` VALUES ('12561282', 'Rhymastic', 'Vu Duc Thien（1991年4月8日出生），别名Rhymastic（称为Rhym）或Young Crizzal（YC），说唱歌手、音乐家、歌手、音乐制作人，越南男性，SpaceSpeakers团队成员。当他能够表达各种流派、音乐主题和说唱时，许多人认为他是越南非常全面的说唱歌手。', 'http://p2.music.126.net/WC-rO-Rkg4JMUYNITNTX0Q==/109951166073899292.jpg');
