INSERT INTO `singer` VALUES ('12676071', '老王乐队', '2015年冬，于台北成立。起初是为了参加校园比赛而生，在获得北医金弦奖第二名之后便进入无限期休团。2016年末，以主唱立长、鼓手会元、吉他手伟硕为核心重组，继续现身于校园比赛；此后依序在淡江金韶奖与贝斯手洁民、政大金旋奖与大提琴手昱萱合作。后因另有生涯规划，昱萱于首张EP《吾十有五而志于学》发行前离团，大提琴手由佳莹接任后，便成为老王乐队今日的编制。\n\n2017年秋，老王乐队以新台湾后民摇的曲风，于9月28日发行第一张EP《吾十有五而志于学》，歌曲在YouTube上创造了每首皆破百万点击的惊人纪录；其中〈我还年轻 我还年轻〉至今已累积破1500万次点击。于2019年秋，发行首张专辑沿用论语篇章为专辑命名为《吾日三省吾身》。\n \n如同音乐特色，老王乐队在歌唱一个世代的光怪陆离时，不忘用幽默、反讽的语词及旋律，以沙哑略带厌世的嗓音，低沉回荡不绝的大提琴，重复而洗脑的旋律，诙谐地唱着属于这个世代的歌。\n\n做着令人印象深刻的音乐，说故事一般道尽世间甘苦。\n\n“Your Woman Sleep With Others“ is a five-member indie-folk rock band from Taipei, Taiwan formed in 2015. The members are Chang (Lead vocal and guitar), Tung (Guitar), Feng (Drum), Shao (Cello) and Liao (Bass). In 2017, Your Woman Sleep With Others released an EP titled “吾十有五儿志于学” . The band’s EP ranked No.1 in Taiwanese indie music streaming service StreetVoice and Spotify charts ,and rapidly soared up to 1 million views on YouTube within three months. \n\n“Your Woman Sleep With Others“ is also a young, award-winning band, that reminds you of The Waterboys and Arcade Fire. Through their lyrics, they share a bloody and ironic truth about education system in Taiwan and graduates in despair.', 'http://p2.music.126.net/woOu3d0DAfs2pnmG9jQmbg==/109951164432246806.jpg');
