INSERT INTO `singer` VALUES ('12741288', '羽生まゐご', '日本のボーカロイド・プロデューサー（ボカロP）。初音ミクやflowerといったボーカロイドを使用した、アンビエントからエレクトロ系まで多岐にわたる曲調が特色。2015年11月に「ゆれる」でボカロPデビュー。以来、ニコニコ動画を中心にボカロ・オリジナル曲を投稿。12作目となる「阿吽のビーツ」で自身初の殿堂入りを達成。その後も「懺悔参り」「ハレハレヤ」などが注目され、和楽器アレンジによる“和”、哀愁漂う“言葉”、瀬川あをじの個性的な“ヴィジュアル”で人気を博す。2018年10月に1stフル・アルバム『浮世巡り』をリリース。', 'http://p2.music.126.net/25RRBSmbpnP2W8qoqHRr1w==/109951164567016507.jpg');
INSERT INTO `singer` VALUES ('12828299', 'Rothy', 'Rothy，한국 solo가수, 1999년 5월 6일 생. 대학에  한림연예예술고등학교 실용음악과에 다니고 있다. \\\n2017년에 대뷔했다. 싱글 앨범 [Stars]를 발행했다.', 'http://p2.music.126.net/GtZKG7rxpiJmB9xLyfdFtQ==/109951165231440534.jpg');
