INSERT INTO `singer` VALUES ('13197163', '张目求思', '张目求思，民谣歌手，天津市天津中学教师，1988年7月27日出生于天津。用一把左手吉他写出了很多动听的旋律，他的歌词并不奢华但却真实亲切，听他的歌总给人娓娓道来的感觉，总能把你真切的带入到故事中。', 'http://p1.music.126.net/u-eELQuFXrbPwMVYDAUmzw==/109951163136602434.jpg');
INSERT INTO `singer` VALUES ('13226756', '稲葉曇', '稲葉曇，于2016/02/22在niconico进行初投稿并开始活动的vocaloidP。通常使用歌愛ユキ（歌爱雪）进行音乐制作。\n代表作《ロストアンブレラ》《ラグトレイン》。\n擅长在歌曲用略微沙哑的少女歌声和冷淡的语调表现情感。\nPV通常以灰色的背景、简单的画风和可爱的重复动作组成。', 'http://p2.music.126.net/EYB99RC22CoGOsRizs607w==/109951165808869381.jpg');
