INSERT INTO `singer` VALUES ('14839429', 'Pháo', 'Phao生于2003年，真名Nguyễn Diệu Huyền，也被称为“地下公主”，在《说唱王》节目中获得导师的四次选秀权后，她获得了极大的关注。\n\n在现实生活中，Phao还是一个开朗友善的女生。她定期参加学校的集体活动以及underground音乐演出。', 'http://p2.music.126.net/1M39pvIaSF0TLQr425361A==/109951165544967787.jpg');
INSERT INTO `singer` VALUES ('15022053', '88rising', '在Rich Brian，Keith Ape和Higher Brothers等新晋潮流新声背后的前卫互联网新锐团队——88rising，是亚洲最具代表性的前瞻思想艺术家和创作者汇集的开拓性媒体平台之一。以连接东西方文化为主旨的88rising以其“大量病毒式传播的视频点击和与美国知名艺术家合作”而闻名（CNN报道）。由世界各地的创意人组成的领导团队屡获殊荣，88rising通过代表亚洲及各地区的独特文化景观，在展示亚洲文化这一方面“显然的填补了空白”（福布斯报道）。', 'http://p1.music.126.net/bj_rmuuX2T_3CWtYeWo_5A==/109951164445634644.jpg');
INSERT INTO `singer` VALUES ('15248022', 'すりぃ', null, 'http://p2.music.126.net/jxYgnWEzw_3ySzMbID43Vg==/109951165955980439.jpg');
INSERT INTO `singer` VALUES ('15284598', 'KAIZ', '来自越南的人气DJ制作人、神曲制造机KAIZ，是越南当地酒吧O2O Hanoi的常驻DJ。2010年至2015年就读于Trưng Nhị Secondary School，2016年12月与越南流行女歌手Hương Giangg订婚。2020年因重制混音越南女歌手Pháo的洗脑单曲《2 Phút Hơn》迅速蹿红，擅长浩室House电子舞曲的他轻易抓住听众的听觉神经，令人过耳难忘，这也是他爆红的原因所在。', 'http://p1.music.126.net/CK6L97xPztm1c-0LALRVpw==/109951165620940867.jpg');
INSERT INTO `singer` VALUES ('27871544', '小嘉玲', '“音乐这种东西，你开心时入耳，伤心时入心。你开心时听的是音乐，难过时听的是歌词。爱一首歌，常常因为某一句歌词，但真正动人的不是那句歌词，而是你生命中那些关于歌词的故事。我希望我的歌能陪你度过孤独岁月，感谢聆听 ”', 'http://p1.music.126.net/v13AY0GqyN8V7tQM0ESKzA==/109951166080063135.jpg');
INSERT INTO `singer` VALUES ('28083351', 'CORSAK胡梦周', '代表作品：《溯》、《芽》、《归》、《DIFFERENT WORLD》、《Sad Sometimes》\n来自上海的CORSAK，是一位唱作词曲编全能的音乐才子、DJ和制作人，他将自身所受到的古典音乐教育与创新的EDM完美地相结合在一起。\n3岁时，他第一次接触音乐，并由此开启了他的钢琴生涯。后来，CORSAK高中时读音乐学校成为吴莫愁的师哥，之后到国内著名的上海音乐学院求学，并在那里学习了作曲与音乐制作。为了追求他的国际知名DJ音乐梦想，他放弃与国内某一影视公司签约的演员生涯。\n2017年发行首张单曲《溯Reverse》，截止目前获得14亿次播放量。\n2018年与国际知名DJ Alan Walker共同制作其首张个人专辑主打歌《Different World》。其后又与Alan Walker合作了《Sad Sometimes》，与国际知名DJ组合 Yellow Claw合作《Take Me Back》。\n2019年登上全球最大最大电音节比利时Tomorrowland舞台，被誉为华人之光。并被评选为2019年度30岁以下福布斯精英榜年度青年精英。\n这位来自Liquid State厂牌的正能量励志偶像，展示他特有的能够将中国传统文化和现代化完美结合的混合曲风, 蕴藏着巨大的商业潜能。这样独特的音乐天赋，让人不容错过。', 'http://p2.music.126.net/qGBIol8skoSjxfSEYTc3Lw==/109951164856155372.jpg');
