INSERT INTO `singer` VALUES ('30471229', '宋雨琦', '宋雨琦（YUQI，우기），1999年9月23日出生于北京市，中国内地女歌手，韩国女子演唱组合(G)I-DLE成员。\n2021年5月13日，发行首张个人专辑《A Page》，共收录2首歌曲，其中歌曲《GIANT》由她本人作词作曲；宋雨琦参与作词作曲歌曲《i\'M THE TREND》、《LOST》；翻唱歌曲《Shallow》《Rise Up》。\n宋雨琦拥有和外貌截然不同的低沉烟嗓，活力十足、反应敏捷，拥有可爱开朗的性格和超强的综艺感。\n', 'http://p2.music.126.net/DM-7OMIk4nlx6TCtF9z8ZQ==/109951166646721679.jpg');
