INSERT INTO `singer` VALUES ('30483044', 'Tricolor', 'Tricolor，来自江苏南京，由主唱丁祾、小新，吉他王磊，贝斯朱磊，鼓手周鹤为主要成员，音乐风格r&b', 'http://p1.music.126.net/ft5b4ksIhIWdsEG5BxsYsQ==/109951163597686835.jpg');
INSERT INTO `singer` VALUES ('30549371', 'FrogMonster', '华人电音组合，于 2018 年 11 月成立，由 John 和 Norvin 两位成员组成。\n化学博士生 John 和影视编曲系 Norvin 曾就读美国同一所大学，看似毫不相关的两人却因对\n电音的热爱而结缘相识。相识后的两人惊奇地发现彼此音乐品味相投，并且都不仅仅满足于\n欣赏 EDM 而是更想创作出优秀的国人原创 EDM，于是一拍即合成立了 FrogMonster 组合\n并开始潜心创作。2020 年 7 月一首热情洋溢的《Remember Our Summer》问世后，迅速在国\n内受到广泛好评与关注，火遍全网各大平台，FrogMonster 这一华人电音组合也因此被越来\n越多的人所了解关注。', 'http://p2.music.126.net/K6-iLRTdCH0BsFXUKjcWEA==/109951165598556065.jpg');
