INSERT INTO `singer` VALUES ('32971452', 'Spaceport Records', 'SPACEPORT RECORDS，2019年8月创立于深圳。迄今为止已有旗下艺人十余名。主推风格包括但不限于Drum & Bass、Melodic Dubstep、Future Bass、Heaven Trap等一切旋律派风格。 秉着积极探索以及融合新事物的精神，SPACEPORT在没有边际的寰宇里不断航行，目标是‘用音乐与文字，记载我们与宇宙的故事’。而目的地，永远是下一个无名星系。\n商务合作洽谈：contact@spaceport.email 投稿请发送demo至邮箱：submit@spaceport.email', 'http://p1.music.126.net/icrrfqnTGPi3EWMWivOsAw==/109951165324251363.jpg');
INSERT INTO `singer` VALUES ('32981149', 'Darker', 'Darker，中国内地华语流行歌手、独立原创音乐人。自己所有音乐作品的编曲以及录音的后期制作全由一人担任。声音干净淡雅柔和。', 'http://p1.music.126.net/xEajeHvI6VXpz9hW8JGIuA==/109951165200540072.jpg');
