INSERT INTO `singer` VALUES ('33917936', 'Interupt', 'In 2019, two Sydney siders came together with a shared passion for heavy, bassline driven house music. Over the course of 12 months, countless hours of experimentation in the studio brought Interupt to life. Their sound is characterised by a fusion of catchy melodies and hard-hitting basslines; a style that\'s quickly gaining traction. Their bootleg refresh of the classic dance anthem, “Show Me Love”, has racked up over 100,000 plays alone. After releasing their first track with international label Crucast, they gained support from international artists, including Skepsis, TS7 & Notion. With their first original single, \"Think About Me\", signed to renowned dance music label, TMRW Music, Interupt is proving that their unique sound is worth all the attention it receives.', 'http://p2.music.126.net/pGh5sLDdXMId6FfBP_BZkw==/109951166701942204.jpg');
INSERT INTO `singer` VALUES ('33927412', 'YOASOBI', 'YOASOBI是由VOCALOID制作人Ayase和创作歌手ikura组成的两人组音乐组合。是“将小说故事音乐化”的组合。', 'http://p2.music.126.net/ab8rTLFv35V74OC5VzK5ng==/109951166701824746.jpg');
