INSERT INTO `singer` VALUES ('37473467', 'PP Krit', 'PP Krit，中文名：林祎凯，中文译名：克里特·安努艾德奇康，大名：Krit Amnuaydechkorn（กฤษฏ์ อำนวยเดชกร），小名：PP（พีพี），出生于1999年4月30日，泰国男演员、歌手、模特。星 座：金牛座 血 型：B型 ,身 高：178 cm 体 重：55 kg, 毕业院校：泰国农业大学 。', 'http://p1.music.126.net/XIbjtVnuXGBYEOJZ_HUC4w==/109951165928233398.jpg');
INSERT INTO `singer` VALUES ('46325856', '库妮珂', '库妮珂，女，汉族，原名刘阳, 音乐唱作人。\n代表作（作曲）：《和田玫瑰》《梦中的巩乃斯河》《丢失》《杏花吟》《女人还是女人》等，2019年与著名诗人俞心樵合作的《近忧远虑》《逆流：你和我》《不容易之诗》被星外星音乐收录进2020年7月发行的诗已成歌第二辑《这一夜持续了一生》。\n2012年，库妮珂以真名刘阳的身份参加了湖南卫视音乐综艺节目《女人如歌》的录制。', 'http://p2.music.126.net/-tfboZcBZUTk15GMcu5g2w==/109951165789353694.jpg');
INSERT INTO `singer` VALUES ('46326089', 'kanaria', '18歳。使用ボーカロイドは初音ミク、ＧＵＭＩ。\n2020年5月に「百鬼祭」投稿でボーカロイドPデビュー、自身初の殿堂入りを達成。若干17歳での投稿、その楽曲性の高さに多くのリスナーに注目を浴びることなった。2020年8月2日には2作目「ＫＩＮＧ」にて、自身初のミリオンを達成。\n日々歌ってみた・踊ってみた等、多くの2次創作が様々なSNS・プラットフォームで投稿され2020年下半期で最もトピックなボカロ曲となっている。今後の活躍が最も注目される若手クリエイターである。\n', 'http://p2.music.126.net/_n1cYzIyoesfwBF7Pv9PjA==/109951165545662017.jpg');
