INSERT INTO `singer` VALUES ('47131872', 'PHONO RECORDS', 'PHONO MUSIC (留声唱片) 是2021年初成立的电子音乐品牌以及艺术家团体，并由旗下的PHONO RECORDS以及Dhyana两个主要厂牌企划进行运营。\n\n留声唱片成立的初衷，是以旗下优秀制作人为发展中心，以让合适的资源更好地服务于每一位艺术家。目前，留声唱片能为制作人们提供作曲作词/专业歌手/全球发行/封面设计以及硬件母带等方面的帮助。\n\n同时，留声唱片与多名海内外艺人拥有着密切的合作联系，并将在不久的将来正式进军国际音乐市场。有着完善、全方位专业运营团队的我们，将以严谨高质量的态度服务每一首发行作品，为国电输出强劲血液。\n\n留声唱片的活动范围也在不断地扩大。我们会逐渐成长为一个涉及音乐发行、线下活动、视觉艺术、潮流文化、泛娱乐产品等方面的综合性大型 IP 品牌。', 'http://p1.music.126.net/e16cE-2oWbefnMpm0Ab6WQ==/109951166716366532.jpg');
