INSERT INTO `singer` VALUES ('48399663', 'Albert Chang 张青峯', '张青峯 (Albert Chang) 出生于台湾，三岁开始学习钢琴和小提琴。国小毕业后随家人移居美国。之后分别在南加州大学和加州大学洛杉矶分校获得录音学士和作曲的硕士学位。研究所期间，跟随已故奥斯卡获奖电影作曲家杰瑞·戈德史密斯学习作曲。\n毕业侯在好莱坞从事电影和游戏配乐。他的原创作品也曾经2次入围好莱坞音乐媒体奖（HMMA）的最佳现代世界音乐专辑。\n', 'http://p2.music.126.net/_IwC1YkMQ_RhrG0oww8NwQ==/109951166676083870.jpg');
